(1, 'The Adi people are one of the most populous groups of indigenous peoples in the Indian state of Arunachal Pradesh. A few thousand are also found in the Tibet Autonomous Region, where they are called the Lhoba together with some of the Nyishi people, Na people, Mishmi people and Tagin people.\r\n\r\nThey live in a region of the Southern Himalayas which falls within the Indian state of Arunachal Pradesh and the Mainling, Lhunze, Zayu, Medog, and Nyingchi counties in the Tibet Autonomous Region, China. The present habitat of the Adi people is heavily influenced by the historic location of the ancient Lhoyu. They are found in the temperate and sub-tropical regions within the districts of Siang, East Siang, Upper Siang, West Siang, Lower Dibang Valley, Lohit, Shi Yomi and Namsai within Arunachal Pradesh. The term \"Adi\" however, is not to be confused with the Lhoba people, since the Lhoba also includes the Mishmi along with the Adi people. All the ethnic groups recognizing themselves as \"Adi\" are believed to be descendants of the Abutani/Abotani. The older term Abor is an exonym from Assamese and its literal meaning is \"independent\". The literal meaning of adi is \"hill\" or \"mountain top\".\r\n\r\nOrganisation of the community -\r\nThe Adi live in hill villages, each traditionally keeping to itself, under a selected chief styled Gam or Gao Burra who moderates the village council, which acts even as the traditional court, referred to as a Kebang. The olden day councils consisted of all the village elders and decisions were decided in a Musup/Dere (village community house).\r\n\r\nAdi is classified as Vulnerable by the UNESCO Atlas of the World\'s Languages in Danger\r\nThe various languages and dialects of the Adi people fall into two groups: Abor (Abor-Minyong, Bor-abor (Padam), Abor-Miri, etc.) and Lhoba (Lho-Pa, Luoba).\r\n\r\nAdi literature has been developed by Christian missionaries since 1900. The missionaries J. H. Lorrain and F. W. Savidge published an Abor-Miri Dictionary in 1906 with the help of Mupak Mili and Atsong Pertin, considered the fathers of the Adi language or Adi script.\r\n\r\nThe Adi speak Hindi as a lingua-franca for communicating with other indigenous groups of people in Arunachal Pradesh and the other northeast states.\r\n\r\nCulture -\r\nThis section does not cite any sources. Please help improve this section by adding citations to reliable sources. Unsourced material may be challenged and removed. (February 2023) (Learn how and when to remove this template message)\r\nA documentary film produced by RIWATCH depicting the cultural heritage and lifestyles of Adi people in Arunachal Pradesh.\r\nDormitories play an important role among the Adi people, and certain rules governing the dormitories are observed. For example, a male can visit the dormitory of a female, although he is not allowed to stay overnight. At times, guardians will have to be around to guide the youngsters.\r\n\r\nThere are separate dresses for women and men which are woven by women of the tribes. Helmets made from cane, bear, and deerskin are sometimes worn by the men, depending on the region.\r\n\r\nWhile the older women wear yellow necklaces and spiral earrings, unmarried girls wear a beyop, an ornament that consists of five to six brass plates fixed under their petticoats. Tattooing was popular among the older women.\r\n\r\nThe traditional measure of a family\'s wealth is the possession of domestic animals (particularly gayals), beads and ornaments, and land.\r\n\r\nFestivals and dances -\r\nThe Adi celebrate a number of festivals, in particular, their prime festivals are Aran, Donggin, Solung, Podi Barbii and Etor. Solung is observed in the first week of September for five days or more. It is a harvest festival performed after the sowing of seeds and transplantation, to seek for future bumper crops. Ponung songs and dances are performed by women folk during the festival. On the last day of Solung, throne and indigenous weaponry are displayed along the passage of the houses – a belief that they would protect people from evil spirits (This ritual is called Taktor).\r\n\r\n\r\nTraditional basket of the Adi people\r\nAdi dances vary from the slow, rustic and beautifully enchanting Ponung style (performed in Solung festival) to the exhilarating, exuberant thumps of Delong performed by men during the Etor festival. These dances have led to certain forms of dancing which jointly narrate a story, the Tapu (War Dance). In the Tapu, the dancers vigorously re-enact the actions of war, its gory details and the triumphant cries of the warriors. Yakjong is performed in the Aran festival. This is another kind of dance whereby the dancers carry sticks with designs created by removing the barks in certain patterns and then put into the fire for some time, which creates the marked black designs.\r\n\r\nThe Adi practice wet rice cultivation and have a considerable agricultural economy. Rice serves as the staple food for them along with meat and other vegetables\r\n\r\nReligion -\r\nThe majority of Adi traditionally follow the tribal Donyi-Polo religion. Worship of gods and goddesses like Kine Nane, Doying Bote, Gumin Soyin and Pedong Nane, etc., and religious observances are led by a shaman, called Miri (can be a female). Each deity is associated with certain tasks and acts as a protector and guardian of various topics related to nature which revolves around their daily life. This includes the food crops, home, rain, etc.\r\n\r\nAdi in Tibet, in particular the Bokars, have adopted Tibetan Buddhism to a certain extent, as a result of Tibetan influence. However, in recent years a revival in indigenous identity on the part of the Tibetan Adi people has made traditional religion popular with the youth again. In modern times, a few Adi people have converted to Christianity. But been increasing and call of local leaders to stop converting and demographics shift.', , 'About Adi Tribe', '2023-12-18 18:56:55.000000', 1, 1);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(2, 'The Munda people are an Austroasiatic-speaking ethnic group of the Indian subcontinent. They speak Mundari as their native language, which belongs to the Munda subgroup of Austroasiatic languages. The Munda are found mainly concentrated in the south and East Chhotanagpur Plateau region of Jharkhand,[7] Odisha and West Bengal.[1][8] The Munda also reside in adjacent areas of Madhya Pradesh as well as in portions of Bangladesh, Nepal, and the state of Tripura.[1][9] They are one of India\'s largest scheduled tribes. Munda people in Tripura are also known as Mura.[10]\r\n\r\nEtymology\r\nMunda means headman of a village in the Munda-Manki system to govern villages in South-east Chotanagpur.[11] They call themselves horoko or ho ko, which means men.[12] Robert Parkin notes that the term \"Munda\" did not belong to the Austroasiatic lexis and is of Sanskrit origin.[13] According to R. R. Prasad, the name \"Munde\" is a Ho word that means \"headman\". It is an honorific name given by Hindus, and hence became a tribal name.[14] According to Standing (1976), it was under British rule that the term Munda started to be used for the tribal group.[15]\r\n\r\nHistory\r\nSee also: Munda peoples § History\r\nAccording to linguist Paul Sidwell, Munda languages arrived on the coast of Odisha from Southeast Asia approximately 4,000 to 3,500 years ago (c. 2000 – c. 1500 BCE).[16][17] The Munda people initially spread from Southeast Asia, but mixed extensively with local Indian populations.[18] They are genetically closely related to Mah Meri and Temuan people of Malaysia.[19]\r\n\r\nAccording to historian R. S. Sharma, tribals who spoke the Munda language occupied the eastern region of ancient India. Many Munda terms occur in Vedic texts that were written between 1500 BCE and 500 BCE. Their presence in texts compiled in the upper Gangetic basin late in that period suggests that Munda speakers were there at the time.[20] According to Barbara A. West, the Mundas claim origin in Uttar Pradesh, and a steady flow eastward in history as other groups moved into their original homeland; she suggests that they inhabited a \"much larger territory\" in ancient India.[21] Recent studies suggest that Munda languages spread as far as Eastern Uttar Pradesh but not beyond that, and impacted Eastern Indo-Aryan languages, as some groups such as Musahar have Munda genetic lineage. The claim of a Munda presence in the Upper Gangetic plain has no linguistic or genetic basis.[22]\r\n\r\n\r\n1903 Group photo of Mundas in Chota Nagpur.\r\nIn the late 1800s, during the British Raj, the Mundas were forced to pay rents and work as bonded labourers to the zamindars. During the Kol uprising in 1823–1833, some Manki Munda revolted due to their disposition and attacked Thikedars, other Mankis, plundered and destroyed villages. This insurgency was suppressed by Thomas Wilkinson.[23] During the 19th century, Munda freedom fighter Birsa Munda began the protest marches calling for non-payment of rents and remission of forest dues. He led guerrilla warfare to uproot the British Raj and establish Munda Raj. He was caught by Company forces, along with his supporters, and died in jail. He is still revered in Jharkhand.[24][better source needed]\r\n\r\n\r\nBirsa Munda rebellion in 1800s\r\nNomadic hunters in the India tribal belt, they became farmers and some were employed in basketwork. With the listing of the Munda people as Scheduled Tribes, many are employed in various governmental organisations (particularly Indian Railways).[25]\r\n\r\nKinship patterns\r\nMunda are divided into a number of exogamous clans. Clans among Mundas are known as Killi, which is similar to Sanskrit word Kula. Munda are patrilineal, and clan name descends father to son. According to tradition, people of the same clan are descendants of the same forefather. Clans among Mundas are of totemic origin. Some clans are:\r\n\r\nFestival\r\nInvolved in agriculture, the Munda people celebrate the seasonal festivals of Mage Parab, Phagu, Karam, Baha parab, Sarhul and Sohrai. Some seasonal festivals have coincided with religious festivals, but their original meaning remains. Their deity is singbonga, which means Sun God.[28]\r\n\r\nMusic\r\nThey have many folk songs, dances, tales and traditional musical instruments. Both sexes participate in dances at social events and festivals. The naqareh is a principal musical instrument.[citation needed] Munda refer to their dance and song as durang and susun respectively. Some folk dances of the Munda are Jadur, Karam Susun and Mage Susun.[29] Mundari music is similar to the music of Sadan. Mundari Mage song (winter) rhythm is similar to the Nagpuri Fagua song (winter, spring) rhythm.[30]\r\n\r\nMunda practice clan exogamy and tribal endogamy. Monogamy is the norm. Bride price is prevalent. Marriage ceremony starts with Sagai and ends with Bidai. Munda enjoy this occasion with feast, drinks and dance.[31] According to Sarat Chandra Roy, Sindurdaan ceremony and turmeric use in marriage clearly reflect Hindu elements borrowed into Munda tradition.[32]\r\n\r\nMunda Lady\r\nAdministrative system\r\nMunda-Manki governing system was prevalent in Kolhan region of Jharkhand. Munda govern their villages by Munda-Manki system. Head of village is called Munda, informant of village is called Dakuwa, village priest is called Deori, assistant of Deori is called Yatra Deori, head of 15 to 20 villages is called Manki, assistant of Manki is called Tahshildar, which collected taxes.[11] The priest \"Deori\" is also prevalent among Hos, Bhumij, Bhuyan, Sounti, Khonds tribe of Odisha and Chutia people of Assam.[36][a] In Chotanagpur division, Munda have adopted Pahan as their village priest.[38]\r\n\r\nEconomic condition\r\nIn a 2016 research paper on subsistence strategies of Mundas in a village of Sunderbans in West Bengal, it was found that many people migrate out of their residences because of poor economic conditions and landlessness. This rural to urban migration has followed a greater trend within India. Men and women engage in forest product collection, cultivation, small business and agricultural as well as non-agricultural jobs. A person or a family may be engaged in multiple occupations, often undertaking risky visits to the forests and rivers. It was also found that younger generation preferred to engage as migrant workers outside the village and often outside the district and the state.', , 'About Munda Tribe', '2023-12-18 19:04:14.000000', 1, 2);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(3, 'The Mizo people, historically recorded as the Lushais, are an ethnic group native to the state of Mizoram in India and neighbouring states of Northeast India. The majority of Mizos outside of India reside in the town of Kalay in Myanmar, making up 55% of the town\'s population. They speak the Tibeto-Burman language of Mizo, the official language and lingua franca of Mizoram. The state has one of the highest literacy rates in India, at more than 90%.[11]\r\n\r\nThe Chin people of Myanmar and the Kuki people of India are the kindred tribes of Mizos and some of the Mizo migrants in Myanmar have accepted the Chin identity. The Chin, Kuki, Mizo, and southern Naga peoples are collectively known as Zo people (Mizo: Zohnahthlak; lit. \"descendants of Zo\") which all speak the Kukish languages.\r\n\r\nEtymology\r\nThe term Mizo is derived from two Mizo words: Mi (民) and Zo. Mi (民) in Mizo means \"person\" or \"civilian\". The term Zo has two meanings. According to one view, Zo means \'highland\' or perhaps \'remote\' (Willem van Schendel\'s term Zomia).[12] Another meaning is \"cool\" or \"crisp\" (i.e., a sense/feeling of cool and refreshing air/environment of higher altitude. \"Zo\" is never used to denote all cool/cold temperatures; the term for such temperature is \"vawt\").\r\n\r\nZo, in its contemporary sense as well as its usage in terms like Mizo, is cultural and denotes an ethnolinguistic group and identity. Hence, while Mizo may be translated as \"highlanders\" or \"people living in high hills\" or \"remote areas,\" the term specifically denotes a person with Zo ethnic membership; that is, Mizo literally means \"A Zo person\".\r\n\r\nMizo is a broad ethnic classification of subgroups or clans inhabiting Mizoram (in colonial times the Lushai Hills) in India. Members of many subgroups, especially speakers of the Central Kuki-Chin languages have joined and adopted the Mizo category.[13]\r\n\r\nAncestral Origins\r\nSee also: Chhinlung\r\nSome Mizos have a belief that their ancestors left a place known as \"Chhinlung\" to immigrate. Some agree that this location is in southern China,[14] situated near on the banks of Yalong River.[14] The Mizos have songs and tales that have been passed down from one generation to the next by influential people about the splendor of the old Chhinlung civilization.[14] However, it has not be archaeologically approved.\r\n\r\nHistorical settlements\r\nAccording to K. S. Latourette, there were political upheavals in China in 210 B.C. when the dynastic rule was abolished and the whole empire was brought under one administrative system. Rebellions broke out and chaos reigned throughout the Chinese state, and the Mizos left China as part of one of those waves of migration. They arrived in the Shan States for the first time in the fifth century. When Mizos arrived there from Chhinlung, the Shans had already established themselves firmly in their States. The Shans did not accept the Mizos as guests but did not exclude them either. Before relocating to the Kabaw Valley in the 8th century, the Mizos had happily resided in the Shan States for almost 300 years.\r\n\r\nIt was in the Kabaw Valley that Mizos had cultural influence with the local Burmese. It is conceivable that the Mizos learned the technique of cultivation from the Burmese at Kabaw as many of their agricultural implements bore the prefix Kawl, a name given by the Mizos to the Burmese.[15]\r\n\r\n\r\nA carved-out stone in the necropolis of Vangchhia\r\nKhampat in the Kabaw Valley (now in Myanmar) is known to have been the next Mizo settlement. The area claimed by the Mizos as their earliest town was encircled by an earthen rampart and divided into several parts. The residence of the ruler stood at the central block called Nan Yar (Palace Site). The construction of the town indicates the Mizos had already acquired considerable architectural skills.', , 'About Lushai aka Mizo Tribe', '2023-12-18 19:09:02.000000', 1, 3);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(4, 'The Meitei people, Meetei people,[12] or Manipuri people[1] is an ethnic group native to Manipur. They form the largest and dominant ethnic group of Manipur in Northeast India. They speak the Meitei language (officially called Manipuri), one of the 22 official languages of the Indian Republic and the sole official language of Government of Manipur.[1][13] The Meiteis primarily settled in the Imphal Valley region in modern-day Manipur, though a sizeable population has settled in the other Indian states of Assam, Tripura, Nagaland, Meghalaya, and Mizoram.[2][14] There is also a notable presence of Meitei people in the neighbouring countries of Myanmar and Bangladesh.[2][11][15] The Meitei ethnic group represents about 53% of Manipur\'s population.\r\n\r\nGeographical distribution\r\nNative land : Manipur\r\nThe Indian state of Manipur has the largest Meitei population among all its geographical distribution.[20]\r\n\r\nBangladesh\r\nMain article: Meitei language in Bangladesh\r\n\r\nAreas where there is significant population of Meiteis in Bangladesh\r\nThe population of Meiteis are found in four districts, namely Sylhet District, Moulvibazar District, Sunamganj District and Habiganj District of the Sylhet Division of Bangladesh. In early times, there were Meitei population in Dhaka, Mymensingh and Comilla also.[21]\r\n\r\nSylhet district\r\nThere are thirteen villages in Sylhet District, which are Amborkhana (Nongthombam Leikai in Meitei language), Nayabazar, Shibgonj, Goaipara, Kewapara, Sagordighirpar (Pukhri Mapan in Meitei language), Baghbari, Laladighipar (Sapam Leikai in Meitei language), Lamabazar (Leichom Leikai in Meitei language), Doxingach, Rajbari (Konung Leikai in Meitei language), Brojonath Tila (Meitei people refer to it as Brajanath Leikai but earlier it was known as Narasingh Tila) and Noyabazar (Sylhet P.S.) among others.\r\n\r\nMyanmar\r\nMyanmar has a significant population of Meitei people in Kachin state, Yangon Region, Sagaing Region, Shan state, Ayeyarwady Region, among others.[23]\r\n\r\nOrigins and history\r\nMain articles: History of Manipur, Meitei literature, Meitei mythology, and Meitei folklore\r\n\"The beginning of this old Manipuri literature (as in the case of Newari) may go back to 1500 years, or even 2000 years, from now.\"[24][25][26]\r\n\r\n—Suniti Kumar Chatterji, Padma Vibhushan awardee Indian scholar\r\nThe earliest sections of the Cheitharol Kumbaba, a Meitei chronicle, record the gradual spread of Meiteis across Kangleipak (Meitei for \'Manipur\') and their assimilation of other clans into a confederacy.[27][28]\r\n\r\nIn Kangleipak (Manipur)\r\nIn 1100 CE, Loyumba Shinyen (Old Manipuri:  romanized: Loyumpa Shinyen), an ancient Meitei language constitution was written and regulated under the supervision of Meitei King Loiyumba (Loyumba) (1074 CE-1112 CE) in the Ancient Kangleipak (early Manipur).[29] It is a formal proclamation of the proto-constitution which was drafted in 429 CE by Meitei King Naophangba.[30][31][32] The idea of its constitutionalism was functional until it was substituted by the Manipur State Constitution Act 1947.\r\n\r\nAs a result of wars between Meitei kingdom and the Konbaung dynasty between the 17th and 18th centuries, many Meiteis were resettled in the Burmese kingdom.[37] Some Meitei settlements in modern-day Myanmar originate from the 1758–1759 war, and from the Burmese occupation of Manipur from 1819 to 1826.[37][35] Alaungpaya, during the former campaign, resettled Meiteis in Sagaing and Amarapura.[35] The Meitei people\'s horsemanship skills were employed in the Burmese royal army, where they formed the elite Cassay cavalry (ကသည်းမြင်းတပ်) and artillery regiments (ကသည်းအမြောက်တပ်) which were employed during the Burmese–Siamese wars.[38] The Burmese court also retained a retinue of Manipuri Brahmins called Bamons, also called Kathe Ponna (ကသည်းပုဏ္ဏား) to advise and conduct court rituals.[35]\r\n\r\nThe word Meitei Lon (Meitei for \'Meitei language\') written in Meitei Mayek (Meitei for \'Meitei script\')\r\nThe Meitei people speak the Meitei language (also known as the Manipuri language), a Tibeto-Burman language. Meitei is one of the officially recognised languages of India, and was included in the Eighth Schedule to the Constitution of India in 1992.[39]\r\n\r\nThere are many Meitei language movements, including classical language movement (predominantly in Manipur), associate official language movement (in Assam), linguistic purism movement (predominantly in Manipur), etc.\r\n\r\nThe Numit Kappa, a Classical Meitei epic text, based on ancient Meitei mythology and traditional Meitei religion (Sanamahism) of ancient Kangleipak (early Manipur)\r\nAmong the heritage of diverse literary works in Meitei literature, the Khamba Thoibi Sheireng, also spelled as the Khamba Thoibi Seireng (Meitei: romanized: Poem on Khamba Thoibi[43]), is regarded as the national epic of the Manipuris.[44][45][46] It is a classical Meitei language epic poem based on the ancient romantic adventure tale of Khamba and Thoibi of the Epic cycles of incarnations in Moirang kingdom[a] of Ancient Kangleipak realm (early Manipur). It is the best known magnum opus of Hijam Anganghal, a Meitei writer. It is often considered to be the greatest of all the epic poems ever written in Meitei language, for having a length of 39,000 verses, thereby becoming the longest Indian epic just after the Mahabharata and the Ramayana.[47][46][48]\r\n\r\n', , 'About Meitei Tribe', '2023-12-18 19:17:57.000000', 1, 4);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(5, 'The Konyaks are a major Naga ethnic group native to the Northeast Indian state of Nagaland.[1] They inhabit the Mon District, which is also known as The Land of the Anghs. The Anghs/Wangs are their traditional chiefs whom they hold in high esteem. Facial tattoos were earned for taking an enemy\'s head.[2]\r\n\r\nOther unique traditional practices that set the Konyaks apart are: gunsmithing, iron-smelting, brass-works, and gunpowder-making. Members of a village were asked to urinate in one particular place for months. Urine has potassium nitrate and sulphur. The urine rich soil is then boiled. A black residue floats on top of the water which is collected, dried, mixed with charcoal, and turned into gunpowder. They are also known for making excellent Yanglaü (machetes) and wooden sculptures.\r\n\r\nSociety\r\nThe Konyaks are the largest of the Naga ethnic groups. They are found in Tirap, Longding, and Changlang districts of Arunachal Pradesh; Sibsagar District of Assam; and in Naga Self-Administered Zone of Myanmar. They are known in Arunachal Pradesh as the Wanchos (\'Wancho\' is a synonymous term for \'Konyak\'). Ethnically, culturally, and linguistically the Nocte and Tangsa of the same neighbouring state of Arunachal Pradesh, are also closely related to the Konyaks. The Konyaks were the last among the Naga ethnic groups to accept Christianity. In the past, they were infamous for attacking nearby villages, often resulting in killings and decapitation of the heads of opposing warriors. The decapitated heads were taken as trophies and usually hung in the \'baan\' (a communal house). The number of hunted heads indicated the power of a warrior. The headhunting expeditions were often driven by certain beliefs, such as code of honour and principles of loyalty and sacrifice.\r\n\r\nThe ethnic members maintain a very disciplined community life with strict adherence to duties and responsibilities assigned to each of them.\r\n\r\nCulture\r\n\r\nA chief of Konyaks in his traditional outfit\r\nFestival\r\nAoleang is a festival celebrated in the first week of April (1–6) to welcome the spring and also to invoke the Almighty\'s (Kahwang) blessing upon the land before seed-sowing, is the biggest festival of the Konyaks. Another festival, Lao Ong Mo, is the traditional harvest festival celebrated in the months of August/September.\r\n\r\n\r\nA ceremonial basket of the Konyak tribe with a skull and two human heads carved from wood. This basket is a status symbol.\r\nLanguage\r\nThe Konyak language belongs to the Northern Naga sub-branch of the Sal sub-family of Sino-Tibetan. Konyak language share similarities with Garo and Bodo languages than it is to other Naga languages.', , 'About Konyak Tribe', '2023-12-18 19:21:03.000000', 1, 5);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(6, 'The Chakma people (Chakma: 𑄌𑄋𑄴𑄟𑄳𑄦), are an ethnic group from the eastern-most regions of the Indian subcontinent. They are the largest ethnic group in the Chittagong Hill Tracts region of southeastern Bangladesh, and the second-largest in Mizoram, India (Chakma Autonomous District). Significant Chakma populations are found in the northeast Indian states of Arunachal Pradesh, Tripura and Assam.\r\n\r\nThe Chakma possess strong ethnic affinities to Tibeto-Burman groups in Northeast India. Because of a language shift in the past to consolidate power among the tribes, they adopted an Indo-Aryan language, Chakma, which is closely related to the Chittagonian dialect of Bengali, predominant near the areas in which they live.[4] Most modern Chakma people practice Theravada Buddhism, due to 19th-century reforms and institutionalisation by Queen regnant Rani Kalindi. In Myanmar, Chakma people are known as Daingnet and are one of the 135 officially recognised ethnic groups there.[citation needed]\r\n\r\nThe Chakmas are divided into 31 clans or gozas.[4] The community is headed by the Chakma Raja, whose status as a tribal head has been historically recognised by the Government of British India and the Government of Bangladesh.\r\n\r\nThe relationships between Chakmas and their neighbours are complex. On one hand, many Chakmas are well-integrated in mainstream middle-class Bangladeshi and Indian society and are particularly notable for their service as officers and ambassadors in Bangladesh\'s military and diplomatic corps. Chakma politicians have served as ministers in the national ministry of Bangladesh and the state ministry of Tripura. However, the persecution of the indigenous tribes of the Chittagong Hill Tracts, of which the Chakma are the predominant ethnicity, has been described as genocidal, but since the Chittagong Hill Tracts Peace Accord, violence in the area has been greatly reduced.[5][6]\r\n\r\nHistory\r\nChakma oral history says they migrated to Arakan from the ancient kingdom of Magadha in the present Bihar state of India. The Chakma believe they are part of Buddha\'s Sakya clan of the Himalayan tribes. They gradually migrated to Arakan and extended their territory to the nearby hills of the Chittagong Hill Tracts.[8]\r\n\r\nThe Arakanese people referred to the Chakmas as Saks, Theks, or Thaikhs. In 1546 CE, while the Arakanese king Min Bin was fighting a battle with the Burmese, the Sak king attacked Northern Arakan Roma and occupied the Arakanese-controlled Chacomas of the Northern Arakan Mountains.[9]\r\n\r\nDiego de Astor created a map of Bengal, which was published as Descripção do Reino de Bengalla in the book Quarta decada da Asia (Fourth decade of Asia) by João de Barros in 1615. The map shows an area named Chacomas on the eastern bank of the Karnaphuli River in what is now Chittagong Bangladesh,[10] suggesting that the Chakmas inhabited this area during the time.\r\n\r\nThe Arakan king Min Razagyi (1593–1612) conquered the areas and styled himself as the highest and most powerful king of Arakan, Chacomas, and Bengal in a 1607 letter to Portuguese mercenary Filipe de Brito e Nicote. After their defeat by the Arakanese, the Chakmas migrated to the present Chittagong Hill Tracts and founded their capital city Alekyangdong (present-day Alikadam). From Alekyangdong, they continued north and settled in present-day Rangunia, Raozan, and Fatikchari Upazilas of Chittagong District.[11]\r\n\r\nIn 1666, the Mughal Governor of Bengal, Shaista Khan, defeated the Arakanese, conquered Chittagong, and renamed it Islamabad.[12] Mughal rule, however, was confined to the plain areas of Chittagong early on, leaving the Chakmas largely unaffected. The Mughals eventually demanded tribute from the Chakmas after a trade dispute developed between the two groups.[13]: 23 \r\n\r\nIn 1713, the conflict was resolved, and a stable relationship developed between the Chakmas and the Mughals; the latter never demanded complete subjugation of the former. The Mughals also rewarded the Chakma king Shukdev Roy; he established a new capital in his name in an area still known as Shukbilash. Ruins of the royal palace and other historic buildings still exist. Subsequently, the capital was shifted to Rajanagar, Ranirhat, Rangunia Upazila, Chittagong District.\r\n\r\nThe Mughals signed a treaty with Jallal Khan, Raja of the Chakma, in 1715. While the Mughals controlled significant amounts of yam and cotton crops in the Chittagong Hill Tracts (CHT), the Chakma\'s independence from the Mughals was recognised.', , 'About Chakma Tribe', '2023-12-18 19:22:52.000000', 1, 6);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(7, 'The Gondi (Gōṇḍī) or Gond people, who refer to themselves as \"Koitur\" (Kōī, Kōītōr), are an ethnolinguistic group in India.[4][5] Their native language, Gondi, belongs to the Dravidian family. They are spread over the states of Madhya Pradesh, Maharashtra,[6] Chhattisgarh, Uttar Pradesh, Telangana, Andhra Pradesh, Bihar, and Odisha. They are listed as a Scheduled Tribe for the purpose of India\'s system of reservation.[7]\r\n\r\nThe Gond have formed many kingdoms of historical significance. Gondwana was the ruling kingdom in the Gondwana region of India. This includes the eastern part of the Vidarbha of Maharashtra. The Garha Kingdom includes the parts of Madhya Pradesh immediately to the north of it and parts of western Chhattisgarh. The wider region extends beyond these, also including parts of northern Telangana, western Odisha, and southern Uttar Pradesh.\r\n\r\nGondi is claimed to be related to the Telugu language. The 2011 Census of India recorded about 2.4 million speakers of Gondi as a macrolanguage and 2.91 million speakers of languages within the Gondi subgroup, including languages such as Maria (also known as Maadiya Gond).[8][9][10] Many Gonds also speak regionally dominant languages such as Hindi, Marathi, Odia, and Telugu.\r\n\r\nAccording to the 1971 census, the Gondi population was 5.01 million. By the 1991 census, this had increased to 9.3 million[11][page needed] and by 2001, the figure was nearly 11 million. For the past few decades, the group has been witness to the Naxalite–Maoist insurgency, in India.[12] Gondi people, at the behest of the Chhattisgarh government, formed the Salwa Judum, an armed militant group, to fight the Naxalite insurgency. This was disbanded by order of the Supreme Court of India on 5 July 2011, however.[13]\r\n\r\nEtymology\r\nThe origin of the name Gond, used by outsiders, is still uncertain. Some believe the word to derive from the Dravidian kond, meaning hill, similar to the Khonds of Odisha.[14]\r\n\r\nAnother theory, according to Vol. 3 of the Worldmark Encyclopedia of Cultures and Daily Life, is that the name was given to them by the Mughal dynasty of the 16th–18th centuries. It was the Mughals who first used the term \"Gond\", meaning \"hill people\", to refer to the group.[15]\r\n\r\nThe Gonds call themselves Koitur (Kōītōr) or Koi (Kōī), which also has no definitive origin.[citation needed]\r\n\r\nHistory\r\nThe origins of the Gonds is unclear. Some researchers have claimed that the Gonds were a collection of disparate tribes that adopted a proto-Gondi language as a mother tongue from a class of rulers, originally speaking various pre-Dravidian languages.[16] While there is an affinity between Gonds and Munda peoples, researchers point to a more complex event involving language shift through a Dravidian linguistic expansion, rather than a recent event of Gondi replacing a North Munda language, hence supporting distinct origins for these two groups.[17][18]\r\n\r\nR. V. Russell believed the Gonds came into Gondwana from the south: up the Godavari into Vidarbha, from there up the Indravati into Bastar, and up the Wardha and Wainganga into the Satpura Range.[19]\r\n\r\nThe first historical reference to the Gonds comes from Muslim writers in the 14th century. Scholars believe that the Gonds ruled in Gondwana, a region extending from what is now eastern Madhya Pradesh to western Odisha and from northern Andhra Pradesh to the southeastern corner of Uttar Pradesh, between the 13th and 19th centuries CE.[6]', , 'About Gond Tribe', '2023-12-18 19:25:37.000000', 2, 7);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(8, 'Bhil or Bheel is an ethnic group in western India. They speak the Bhil languages, a subgroup of the Western Zone of the Indo-Aryan languages.[4] Bhils are members of a tribal group outside the fold of Hinduism and the caste system.[5]\r\n\r\nBhils are listed as tribal people in the states of Gujarat, Madhya Pradesh, Chhattisgarh, Maharashtra and Rajasthan—all in the western Deccan regions and central India—as well as in Bengal and Tripura in far-eastern India, on the border with Bangladesh. Bhils are divided into a number of endogamous territorial divisions, which in turn have a number of clans and lineages. Many Bhils now speak the dominant later language of the region they reside in, such as Marathi, Gujarati, Bengali or a Bhili language dialect.\r\n\r\nHistory\r\nThe Bhil Kings have been mentioned in the Mahabharata as rulers of Malwa and Central India from the time of the Mahabharata to 325 B.C.[7]\r\n\r\nAccording to John Samuel, as per legendary cum historical records, the Bhil tribals controlled large parts of Gujarat from 11th to 15th century before the Rajputs conquered the territories from these locals.[5]\r\n\r\nRebellion against Mughal\r\nRana punja was grandson of Bhil Chief Harpal Bhil of Oghna Panarawa.[8] He was the king of Merpur and he supported Maharana Pratap against Akbar.\r\n\r\nBhil Rebellion\r\nThe rulers of Idar, Rajpipla, Mándvi Bánsda and Dharampur princely states in southern Gujarat were Bhils.[9]\r\n\r\nThe Bhils of what is now the state of Gujarat rebelled on several occasions during the British colonial era, notably in 1846, 1857–58 and 1868.[10]\r\n\r\nAlong with a number of other Indian social groups, the Bhils were designated as a criminal tribe by the British colonial government under the Criminal Tribes Act 1871, which meant that a Bhil could be \"randomly picked up, tortured, maimed or even killed\" by the colonial authorities. Susan Abraham notes that many of the tribes characterized as criminal under the Act had earlier rebelled against the East India Company and participated in the Indian Rebellion of 1857. She claims that the British colonial government legislated the Act in 1871 in the wake of these autochthonic tribes\' proclivity for rebellion.[11]', , 'About Bhil Tribe', '2023-12-18 19:26:49.000000', 2, 8);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(9, 'The Kol people referred to a group of tribal communities of Chotanagpur in eastern parts of India. Historically, the Mundas, Oraons, Hos and Bhumijs were called Kols by the British.[1]\r\n\r\nIt also refers to some tribes and castes of south-east Uttar Pradesh, Madhya Pradesh and Maharashtra.[2][3] They are mostly Indigenous people and dependent on forest produce to make a living, and they have their own land. The caste has several exogamous clans, including the Bhil, Chero, Monasi, Rautia, Raut, Gauthiya Rojaboria‚ Rautel and Thakuria. They speaks the Baghelkhandi dialect.[4] Around 1 million lives in Madhya Pradesh while another 5 lakh lives in Uttar Pradesh.\r\n\r\nOnce spelled \"Kole\", the swaths of land they inhabited in the 19th-century were called \"Kolean\".[3]\r\n\r\nEtymology\r\nKol was generic term for non-Aryan people in Chotanagpur such as Oraon and Munda. The term Kola mentioned in Rigveda. According to legend, Yayati, the son of Nahus divided his kingdom for his five sons. Then after ten generation, India was divided among four brothers; Pandya, Krala, Kola and Chola. According to Markandeya Purana, the Aryan princess Suratha was defeated by some unclean tribe called Kolabidhansinah means slayer of Pig. According to Herr Jelinghans, Kolarian tribes who eat pig were considered unclean by the hindus.[5] Another meaning of Kol is Pig.[6]\r\n\r\nHistory\r\nColonel Edward Tuite Dalton has refferd to non-Aryan Kolarian and Dravidian tribals of Chotanagpur as Kol such as Munda, Oraon, Ho, Santal, Bhumij, Juang, etc in his writings in 1867. According to him, the word is epithets of abuse applied by the Brahmin races to the aboriginals who opposed their settlements. In Chotanagpur, the term kol generally applied to Munda and Oraon. Although, Oraon and Munda celebrate same festivals, but they don\'t intermarry among themselves.[7] [8]\r\n\r\nLater, Colonel Dalton classified Oraon as Dravidian and Munda, along with other Kols such as Ho, Bhumij as Kolarian after observing their customs and traditions which were distinct.[9]', , 'About Kol Tribe', '2023-12-18 19:27:46.000000', 2, 9);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(10, 'The Santhal tribe is one of the largest and most widely distributed tribal communities in India. Here\'s some information about the Santhal tribe:\r\n\r\nLocation:\r\n\r\nThe Santhal people primarily inhabit the states of Jharkhand, West Bengal, Bihar, Odisha, and Assam. They are also found in parts of Bangladesh.\r\nLanguage:\r\n\r\nThe Santhali language belongs to the Austroasiatic language family. It is the main language spoken by the Santhal community.\r\nSocial Structure:\r\n\r\nThe Santhals have a well-defined social structure with clans and a council of elders known as the \"Manjhi.\" Each clan is headed by a chief called the \"Pargana\" or \"Manjhi,\" who plays a crucial role in maintaining social order and resolving disputes.\r\nEconomy:\r\n\r\nTraditionally, the Santhals were primarily agriculturalists, cultivating crops like rice, pulses, and millets. They also practice animal husbandry and engage in activities such as hunting and fishing.\r\nCulture and Traditions:\r\n\r\nThe Santhals have a rich cultural heritage with a strong emphasis on music, dance, and art. Their traditional dance forms, such as \"Baha\" and \"Dhol,\" are integral parts of their festivals and celebrations. Santhal music and dance often depict daily life, nature, and their close connection to the environment', , 'About Santhal Tribe', '2023-12-18 19:30:39.000000', 2, 10);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(11, 'The origin of the Gaddi Tribe is unclear. Their oral history includes stories of their ancestors fleeing from the plains to a hillier region in search of security against foreign invasions. These may only be popular myths; there is no academic consensus about their origin.\r\n\r\nThe Gaddi nomenclature springs from the word \"Gaderan\", the native word for the hilly tracts of Himachal Pradesh. Gaddis, a Scheduled Tribe of Himachal Pradesh, are found principally focused in Bharmauri of Chamba district, an area popularly called ‘Gaderan’ which means ‘the home of the Gaddis’. Bharmour is additionally known as the abode of Gaddis.[citation needed] The term \"Gaddi\" conjointly refers to a territorial cluster of a special category of individual forming an exogamous union of Brahmin, Rajputs, Khatris and other castes whose primary traditional occupations were agriculture and goatherding. The word ‘Gaddi’ derives from the Sanskrit word \"Gabdika\" (गब्दिक), an Ancient Tribal Republic mentioned in Paninis Ashtadhyayi, where present day Gaddis live. Many believe that Kailash is the throne (gadi) of the Lord Shiva, and that therefore, those people who took refuge and settled in Brahmaur also came to be referred as Gaddis.\r\n\r\nGaddis are semi nomadic, semi-agricultural and a semi-pastoral tribe. They have a defined culture, expressed through language, dress, food, marriage, song, and devout celebrations. Gaddis have their imperial history deep-rooted in their culture. In order to preserve their cultural heritage, they take pride in their culture and maintain cultural coherence from generation to generation. Gaddi is the language of Gaddi community and Tankri is the script used by the old people of the community. Other people spoke Hindi, whereas Devanagari is used as a script.\r\n\r\nThe caste system prevalent in the Gaddi community. Some are Gaddi Rajput and some are Gaddi Brahmin which are also called Bhatt Brahmin. They came in Chamba during the reign of Ajai Verma in the 8th century. They believe they are descendants of Lord Shiva. They also believe in Lord Kartikeya (kelang), gugga and awtars. Nuala is a holiday celebrated by this community, in which they offer sheep to Lord Shiva, chant the aincheliya, and dance all night.\r\n\r\nAccording to the 2011 Census of India, the Gaddi population was 178,130 in Himachal Pradesh and 46,489 in Jammu Kashmir. The Gaddis of Himachal Pradesh had an adult sex ratio of 1014 and literacy rate of 73.3, whereas those of Jammu and Kashmir had a sex ratio of 953 and literacy of 53.5. They are classified as a scheduled tribe in both areas under India\'s reservation system.[1]', , 'About Gaddi Tribe', '2023-12-18 19:32:34.000000', 3, 12);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(12, '- The Swangala tribe historically practiced shifting cultivation, which \r\nis also known as \"jhum\" cultivation, involving the clearing of land \r\nand growing crops. However, due to changes in land-use patterns \r\nand environmental concerns, many have shifted to settled \r\nagriculture.\r\n- Agriculture remains a primary source of livelihood. The Oraon \r\npeople grow a variety of crops, including rice, maize, millets, and \r\npulses.\r\n- In addition to agriculture, the Oraon people engage in activities \r\nlike animal husbandry, poultry farming, and small-scale trade.\r\n**Challenges and Issues:**\r\n- Land Rights: Land alienation and disputes over land ownership \r\nhave been longstanding issues among the Oraon community, \r\nparticularly in the context of changing land-use patterns and \r\nurbanization.\r\n- Access to Education: Ensuring access to quality education, \r\nparticularly in remote and rural areas, remains a challenge.\r\n- Socioeconomic Development: Like many indigenous \r\ncommunities, the Oraon tribe faces challenges related to \r\neconomic development, access to healthcare, and infrastructure \r\ndevelopment.\r\n their cultural traditions.\r\nThe Oraon tribe plays a significant role in the cultural tapestry of \r\neastern India, and their unique traditions, festivals, and \r\nagricultural practices continue to contribute to the rich diversity \r\nof the Chota Nagpur Plateau region. While they face challenges \r\nrelated to land rights and socioeconomic development, ongoing \r\nefforts aim to address these issues and promote the well-being of \r\nthe Oraon community.', , 'About Swangala Tribe', '2023-12-18 19:40:55.000000', 3, 14),
(13, 'The Jad people are a semi nomadic tribe living in great Himalayas in Himachal Pradesh and Uttarakhand states of India. They are primarily settled in the bordering region of Uttarakhand (Uttarkashi district), Himachal Pradesh (Kinnaur district) and Tibet. They mainly practiced sheep rearing and were shrewd traders trading with the Tibet. They were also recognised as the rulers of the Gartang Garh (one among the 52 Garhs or forts of the Garhwal Kingdom). The famous tourist destination Gartang Gali is also found near their village. They were entrusted by the King of Garhwal, with the important strategic task of securing the borders of Garhwal Kingdom from the Bushahr kingdom of Himachal and the Tibetan Empire. The language they speak is critically endangered almost endemic to India. Although, the language share some similarity to the kinnauri and spiti language which also Is of Tibeto-Burman family.[1]\r\n\r\nEtymology\r\nJadhang village itself and Jad people living in Jadhang and Nelang valley are named after a man \"Jadha\" who was resettled here in 1849 by a british adventurer Frederick Wilson. The settlement document of Garhwal Kingdom, which administered this area, from that era reads, \"Wilson invited certain Jadha from the upper Pargana of Kunawar in Bashahr state (now in Himachal Pradesh) to settle at Nilang, re-establish the hamlet of Jadhang and administered the area on behalf of Maharaja Bhavani Shah [r. 1859-71 CE].\" Wilson also built the Gartang Gali stairway.[2]\r\n\r\nSocial status\r\nAs of 2001, the Jad people were classified as a Scheduled Tribe under the Indian government\'s reservation program of positive discrimination.[1]', , 'About Jad Tribe', '2023-12-18 19:41:59.000000', 3, 15);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(14, 'The Badagas are an ethno-linguistic community living in the Nilgiri district in Tamil Nadu, India. Throughout the district the Badugas live in nearly 400 villages, called Hattis. The Badagas speak a language called Badaga.\r\n\r\nHistory\r\nThe name Badaga, meaning \'northerner\', comes from Old Kannada Badagana, meaning \'north.\'According to the Badaga oral tradition, their ancestors were presumed to be Vokkaligas who migrated from the plains of Mysore to avoid Muslim persecution.[1][2] According to American anthropologist Paul Hockings, whose research on the Badagas spans nearly six decades, \"the (Badaga) tribe despite its sketchy history is as indigenous to the Nilgiris as the English are to Britain.\"[3]\r\n\r\nThey claim to come from seven siblings living in the Talamalai Hills. After they fled from a Muslim ruler who tried to rape their sister, they settled in different parts of the Nilgiris. The second brother, Hethappa, was working outside when two Todas raped his wife and took his goods. He sought the aid of two Bayaluru, who agreed to help him if they married his two daughters. They killed the Todas, and the inhabitants of the village at the time claimed descent from the Bayalurus and Badaga daughters.[4]\r\n\r\nCulture\r\n\r\nBadaga temple\r\nThroughout the district the Badagas live in nearly 400 villages, called Hattis.[citation needed]\r\n\r\nThundu (a white piece of cloth) and Seeley forms an integral part of the attire of the Badugu women.[citation needed]\r\n\r\nBadugas marry within their community and follow their own marriage traditions. Their important festival is Devva Habba. Devva Habba provides significant insights into the origin of Badugas. They have certain rules and regulations to be followed in implementing their cultural rituals from the birth of a child and follows through functions like puberty, marriage, naming ceremony, seventh-month pregnancy, housewarming, and finally in death.\r\n\r\nThey worship their seven founding ancestors under the name Hethappa or Hetha.[4]\r\n\r\nDuring time of early 1900s they were known to swear very solemn oaths by the Sri Mariamman temple. For this they bathed, brought coconut and fruit, and killed an animal. The head they put on the step of the shrine, and from seven feet off they would walk to the temple step and put out the light that was shining in front of the idol. Even the Britisher judges, in court, would also abide by this practice and occasionally send witnesses to do this ritual along with a Court official to ensure they were telling the truth.[4] Even today they place great reverence in Sri Mariamman: in April they celebrate a car festival at the Sri Mariamman temple in Ooty when they pull the car with the image of Sri Mariamman to their music and dance.[5]\r\n\r\nLanguage\r\nThe Badaga language is spoken by the Badaga community. The language is closely related to Kannada. LACITO in Paris houses numerous varieties of Badaga stories and songs collected over the past two decades.[6]', , 'About Badaga Tribe', '2023-12-18 19:44:09.000000', 4, 16);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(15, 'Irula, also known as Iruliga, are a Dravidian ethnic group inhabiting the Indian states of Tamil Nadu, Kerala and Karnataka.[2] A scheduled tribe, their population in this region is estimated at around 200,000 people.[3][4] People of Irula ethnicity are called Irular, and speak Irula, which belongs to the Dravidian languages family.[5]\r\n\r\nDistribution\r\nThe tribe numbers around 200,000 spread across three states: 189,621 in Tamil Nadu, 23,721 in Kerala and 10,259 in Karnataka. Those in Karnataka are named Iruligas. The Irulas are mainly concentrated in northern Tamil Nadu: in a wedge extending from Krishnagiri and Dharmapuri districts in the west to Ariyalur and Cuddalore districts in the south and Tiruvallur district in the north. Small populations live in Coimbatore and Nilgiris districts and were classified by Thurston as a different population. In Kerala, the Irulas are in Palakkad district, while in Karnataka they are concentrated in Ramanagara and Bangalore districts.[1]\r\n\r\nLanguage\r\nThe Irula speak the Irula language, a Dravidian language that is closely related to Tamil.[6]\r\n\r\nEconomy\r\n\r\nIrula man and woman tilling the soil.\r\n\r\nIrala rat catchers, Tamil Nadu\r\nTraditionally, the main occupation of the Irulas has been snake, rat catching and honey collection. They also work as labourers[7] (coolies) in the fields of the landlords during the sowing and harvesting seasons or in the rice mills. Fishing and cattle farm is also a major occupation.\r\n\r\nRats destroy a quarter of the grain grown on Tamil Nadu-area farms annually. To combat this pest, Irula men use a traditional earthen pot fumigation method. Smoke is blown through their mouths, which leads to severe respiratory and heart problems.[3]\r\n\r\nIn January 2017, Masi Sadaiyan and Vadivel Gopal from the Irula tribe of Tamil Nadu were brought in, along with two translators, to work with detection dogs to track down and capture invasive Burmese pythons in Key Largo, Florida.[8] The Irula men and their translators were paid $70,000 by the State of Florida, and captured 14 pythons in less than two weeks.[9]\r\n\r\nCaste discrimination\r\nIrula people face severe discrimination and harassment from other castes and numerous such cases are reported every year.', , 'About Irula Tribe', '2023-12-18 19:45:14.000000', 4, 17);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(16, 'Kotas, also Kothar or Kov by self-designation, are an ethnic group who are indigenous to the Nilgiris mountain range in Tamil Nadu, India. They are one of the many tribal people indigenous to the region. (Others are the Todas, Irulas and Kurumbas). Todas and Kotas have been subject to intense anthropological, linguistic and genetic analysis since the early 19th century. Study of Todas and Kotas has also been influential in the development of the field of anthropology. Numerically Kotas have always been a small group not exceeding 1,500 individuals spread over seven villages for the last 160 years. They have maintained a lifestyle as a jack of all trades such as potters, agriculturalist, leather workers, carpenters, and black smiths and as musicians for other groups. Since the British colonial period they have availed themselves of educational facilities and have improved their socio-economic status and no longer depend on the traditional services provided to make a living. Some anthropologists have considered them to be a specialized caste as opposed to a tribe or an ethnic group.\r\n\r\nKotas have their own unique language that belongs to the Dravidian language family but diverged from South Dravidian sub family at some time in BCE. Their language was studied in detail by Murray Barnson Emeneau, a pioneer in the field of Dravidian linguistics. Their social institutions were distinct from mainstream Indian cultural norms and had some similarities to Todas and other tribal people in neighbouring Kerala and the prominent Nair caste. It was informed by a fraternal polygyny where possible. Kota religion was unlike Hinduism and believed in non-anthropomorphic male deities and a female deity. Since the 1940s, many mainstream Hindu deities also have been adopted into the Kota pantheon and temples of Tamil style have been built to accommodate their worship. They’ve had specialized groups of priests to propitiate their deities on behalf of the group.\r\n\r\nIdentity\r\nThe Indian government considers them to be a scheduled tribe (ST), a designation reserved for indigenous tribal communities throughout India that are usually at a lower socio-economic status than mainstream society.[1] They also have a special status as a Primitive Tribal Group (PTG) based on certain socio economic and demographic indicators.[2] But the Kotas are a relatively successful group that makes its living as agriculturalists, doctors, post masters and availing themselves of any government and private sector employment.[1] Few anthropologists and local community members consider them to be a service caste placed in Nilgiris to service others but Kotas consider themselves to be original inhabitants of the region and do not accept the servile status.[1] The name Kota is a term applied to the group by outsiders; Kotas refer to themselves as \'Kov\'. There are number of meanings attributed to the term, but according to Emeneau,[3] ko-v meant a male potter and ko-ty a female potter.[2] Since the 1930s through the efforts of a Kota school teacher, social reformer and activist named Sulli Kota and his followers, Kotas have transformed their previous traditional relationships away from serving other so called high prestige ethnic groups and upgraded their socio-economic status.[4] They still observe their traditional practices.[1]', , 'About Kota Tribe', '2023-12-18 19:46:26.000000', 4, 18);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(18, 'This article is all about Bharia Tribe of Madhya Pradesh. This article incorporates the information about its location, Social formation, Economical conditions, Physical appearance, Religious belief etc. so read it and gains the knowledge.\r\n\r\nBharia tribe is one of the especially backward tribe of Madhya Pradesh. This position is given to Bharia\'s because still they are far away from the education and modern living. Bharia\'s consider themselves as the younger brothers of Gond tribe and hence they consider it to be a duty of them to marry with the Gond widow. Due to the mentioned reasons we can conclude that both these tribes are interrelated.\r\n\r\nEspecially Patalkot of Chhindwara district and Jabalpur are saturated from this tribe. The people of these areas especially of Patalkot are still living in their primitive way. Bhariya Tribe belongs to \"Kolerjan Group\".\r\nImage of Patalkot\r\n(This image is Taken from indianetzone.com)\r\n\r\nPhysical Appearance\r\n\r\nBharia\'s people have dark complexion, medium height, slim body, generally black colored short eyes, broad nostrils, thin lips, and very small sized teeth.\r\nThe feminine body line of this tribe is slimmer then the masculine body line of this tribe but females are very beautiful of this tribe.\r\nPeople of Bharia tribe\r\n(This image is taken from indianetzone.com)\r\n\r\nSocial Formation\r\n\r\nThe head of Bharia\'s is honored with the title of \"Patel\". In the society of Bharia\'s different responsibility is allotted to different officers and the main officers are:\r\n\r\nBhumka\r\n\r\nPadihar\r\n\r\nKotyar\r\n\r\n\r\nThere is equal right for both men and women in Bharia Society. Bharia people follow the system of Gotra, two cousins having different Gotra can get married but a boy and a girl having same Gotra can\'t. Chhudi wearing system has great importance in their society.\r\n\r\nHousing\r\n\r\nBharia\'s are economically very week that\'s why they generally use to live in Kuchcha houses made of wood, grass, bamboo and other trees branches.\r\n\r\nFood\r\n\r\nBharia\'s main dish is \"Page\". In general they use to have Mahua seeds, Mango seeds, floor chapatti, tree roots and fruits according to season. The people of this tribe are normally non-vegetarian and love to hunt.\r\n\r\nClothing\r\n\r\nMen of Bharia tribe use to wear Kurta, Dhoti, Bandi safa on head. The young boys of this tribe tie a broad piece of cloth on their heads.\r\nFemales of this tribe use to wear red color Sedri sari and polka.\r\n\r\nReligious Belief\r\n\r\nThe people of Bharia tribe call them as Hindu and worship many Hindu God and Goddesses. They also celebrate some of the Hindu festivals but they are also influenced by other tribes hence they also worship tribal God and Goddesses, by name they are mentioned below\r\n\r\nFestivals\r\n\r\nAs we had discussed above that Bharia tribe observe many Hindu festivals but along with this they also celebrates tribal festivals, by name they are mentioned below:', , 'About Bharia Tribe', '2023-12-18 19:53:36.000000', 5, 21);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(19, 'Nayakas of Keladi (1499–1763), also known as Nayakas of Bednore and Ikkeri Nayakas, were an Indian dynasty based in Keladi in present-day Shimoga district of Karnataka, India. They were an important ruling dynasty in post-medieval Karnataka. They initially ruled as a vassal of the famous Vijayanagar Empire. After the fall of the empire in 1565, they gained independence and ruled significant parts of Malnad region of the Western Ghats in present-day Karnataka, most areas in the coastal regions of Karnataka and the central plains along the Tungabhadra river. In 1763 AD, with their defeat to Hyder Ali, they were absorbed into the Kingdom of Mysore. They played an important part in the history of Karnataka,[1] during a time of confusion and fragmentation that generally prevailed in South India after the fall of the Vijayanagar Empire. The Keladi rulers were of the Vokkaliga[2] and Banajiga[2] castes and were Veerashaivas by faith.[3][4] The Haleri Kingdom that ruled over Coorg between 1600 A.D and 1834 A.D. was founded by a member of the Keladi family.[5]\r\n\r\nNayaka clan\r\nChaudappa Nayaka, originally Chauda Gowda, (1499–1530), was from a village called Pallibailu near Keladi. He was the son of couple Basavappa and Basavamambe, who were into farming.[6] He was the earliest chieftain to rule the area surrounding Shimoga, rose through self capability and acumen and was a feudatory of Vijayanagara Empire.\r\n\r\nSadashiva Nayaka (1530–1566)[7] was an important chieftain in the Vijayanagar Empire and earned the title Kotekolahala from emperor Aliya Rama Raya for his heroics in the battle of Kalyani. The coastal provinces of Karnataka came under his direct rule. He moved the capital to Ikkeri some 20 km. from Keladi.\r\n\r\nSankanna Nayaka (1566–1570), succeeded Sadashiva Nayaka.\r\n\r\nChikka Sankanna Nayaka (1570–1580) was an opportunistic ruler who took advantage of the confusion in the Vijayanagar Empire following its defeat at Tallikota and grabbed a few provinces in Uttara Kannada district.\r\n\r\nRama Raja Nayaka (1580–1586)\r\n\r\nShivappa Nayaka (1645–1660) is widely considered as the ablest and greatest of the Keladi rulers. He was the uncle of Virabhadra Nayaka. Shivappa deposed his nephew to gain the throne of Keladi. He was not only an able administrator; he also patronised literature and fine arts. His successful campaigns against the Bijapur sultans, the Mysore kings, the Portuguese, and other Nayakas of the neighbouring territories east of the western ghats helped expand the kingdom to its greatest extent, covering large areas of present-day Karnataka. He gave importance to agriculture and developed new schemes for collection of taxes and revenues which earned him much praise from later British officials. A statue of him and the palace built by him containing many artifacts of his times are reminders of the respect he has earned even from the present generation of people of the region. He destroyed the Portuguese political power in the Kanara region by capturing all the Portuguese forts of the coastal region.[9]\r\n\r\nChikka Venkatappa Nayaka (1660–1662), ruled for a short span of time after Shivappa Nayaka.\r\n\r\nBhadrappa Nayaka (1662–1664), succeeded Chikka Venkatappa Nayaka. During his reign the rule of Vokkaligas came to an end and was replaced by the rule of Banajigas.[10]\r\n\r\nSomashekara Nayaka I (1664–1672) The King who was once a good administrator, gave up his interest in administration after his association with a dancer named Kalavati. Bharame Mavuta, a relative of Kalavati slow poisoned the king which eventually led to his death.\r\n\r\nKeladi Chennamma (1672–1697) She was an able ruler who some scholars claim was allied with the Maratha Shivaji and later his son Sambhaji to defeat all rival claimants to the throne. She gave shelter to Chhatrapathi Rajaram when he fled from the Mughal army. Chennamma of Keladi is well remembered by local people through tales of her bravery.\r\n\r\nQueen Virammaji (1757–1763) was defeated by Hyder Ali who merged the Keladi kingdom with the Kingdom of Mysore. The queen was captured by Hyder Ali and was kept in confinement along with her son in the fort of Madugiri.[12] They were however rescued in 1767 when Madhavrao I of the Maratha Empire defeated Hyder Ali in the battle of Madugiri. Later, they were sent to Pune the capital of the Maratha Empire for protection.[12]', , 'About Nayaka Tribe', '2023-12-18 19:56:24.000000', 6, 22);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(20, 'The Banjara are an ethnic trading group which may have origins in the Mewar region of what is now the state of Rajasthan, India\r\n\r\nEtymology\r\nThe Gor usually refer to themselves as Banjaras and outsiders as Kor but this usage does not extend outside their own community. A related usage is Gor Mati or Gormati, meaning Own People.[1][2] Motiraj Rathod believes that the community became known as banjara from around the fourteenth century AD and but previously had some association with the Laman, who claim a 3000-year history.[3]\r\n\r\nIrfan Habib believes the origin of banjara lies in the Sanskrit word variously rendered as vanij, vanik and banik, as does the name of the Bania caste, which historically was India\'s \"pre-eminent\" trading community.[4] However, According to B. G. Halbar, the word Banjara is derived from the Sanskrit word vana chara.[5][a]\r\n\r\nDespite the community adopting a multitude of languages, Banjara is used throughout India, although in Karnataka the name is altered to Banijagaru.[7] A survey conducted in 1968 by the All India Banjara Seva Sangh, a caste association, recorded 27 synonyms and 17 sub-groups.[8]\r\n\r\nHistory\r\nAccording to author J. J. Roy Burman, Banjaras have settled across Rajasthan and other parts of India.[9] Together with the Bhopa, Domba and Kalbelia, they are sometimes called the \"Gypsies of India\".[10] Professor D. B. Naik says that, \"There are so many cultural similarities in the Roma Gypsies and the Banjara Lambanis\".[11]\r\n\r\nTogether with the Bhopa, Domba and Kalbelia, they are sometimes called the \"Gypsies of India\".[12] Professor D. B. Naik says that, \"There are so many cultural similarities in the Roma Gypsies and the Banjara Lambanis\".[13][clarification needed]\r\n\r\nAuthor B. G. Halbar says that, Most of nomadic communities believe that they are descended from Rajput ancestry. All these nomadic tribal groups who claim Rajput ancestry says that during the time of Mughal domination they were retreated to the forests and vowed to return only when the foreign influence had gone. B. G. Halbar says they appear to be of mixed ethnicity, possibly originating in north-central India.[5] However, Habib notes that their constituent groups may not in fact share a common origin, with the theories that suggest otherwise reflecting the systemic bias of nineteenth-century British ethnographers who were keen to create simple classifications.[14] Laxman Satya notes that \"Their status as Banjaras was circumscribed by the colonial state disregarding the rich diversity that existed among various groups\".[15]\r\n\r\nAlthough not referred to as Banjara until the sixteenth century, Habib believes that the royal court chroniclers Ziauddin Barani and Shaikh Nasiruddin documented them operating in the Delhi Sultanate some centuries earlier, around the time of the rule of Alauddin Khalji.[16] Halbar dates things earlier, suggesting that Dandin, a Sanskrit writer who lived in the sixth century, refers to them but, again, not by name.[5]', , 'About Banjaras Tribe', '2023-12-18 19:57:51.000000', 6, 23);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(21, 'The Aminidivi Islands, are one of the three island subgroups in the Union Territory of Lakshadweep, India. It is the northern group of the Lakshadweep, separated from the Laccadive Islands subgroup roughly by the 11th parallel north.[1] The total land area of the group is 9.26 km².\r\n\r\nFormerly the Union Territory was known as Laccadive, Minicoy, and Amindivi Islands,[2] a name that was changed to Lakshadweep by an act of Parliament in 1973.[3] The Aminidivi group forms a taluka or subdivision.[4] The islands of Amini, Kiltan, Chetlat, Kadmat and Bitra are inhabited. The population numbered 18,876 at the 2001 census and Islam is the main religion of the islanders.[5]\r\n\r\nAminidivi has the highest recorded rainfall in India in a 24-hour period, at 1,168 mm on 2004-05-06.\r\n\r\nGeography\r\nAminidivi consists of atolls with islands, three reefs or atolls with only unvegetated sand cays above the high water mark, and four submerged banks.[6] In addition, there is the island that gives its name to the group, Amini, which is located at 11°06′N 72°45′E at the northwestern end of Pitti Bank, a largely sunken atoll.   History\r\nThe islands were inhabited from ancient times by people of nearby Kerala to which were added later people of Arab descent. Vasco da Gama visited these islands around 1498. In the mid 16th century all the inhabited islands of the Lakshadweep were conferred as jagir on the ruling family of the Cannanore Kingdom (Arakkal Kingdom) by the Chirakkal or Kolattiri Raja in order to grant protection from the Portuguese.[10]\r\n\r\nIn the latter quarter of the 18th century the islands of the Amindivi group of the Lakshadweep revolted owing to the rigours of the enforcement of the monopoly of coir rope trade.[11] Following the uprising, the northern islands put themselves under the rule of the Kingdom of Mysore in 1784, then ruled by Tippu Sultan. The southern group of the Cannanore Islands, however, remained loyal to the Arakkal Kingdom.[12]\r\n\r\nIn 1792, as a consequence of the Third Anglo-Mysore War and the defeat of Tippu Sultan, the Amindivi Islands came under the East India Company rule following the treaty of Srirangapatna. The Amindivi subgroup was then attached to the Kasaragod taluk of South Canara in the Madras Presidency of the British Raj in 1799,[13][14][15] hence they also became known as the South Kanara Islands.[16]', , 'About Aminidivis Tribe', '2023-12-18 19:58:47.000000', 7, 24);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(22, 'Koya are an Indian tribal community found in the states of Andhra Pradesh, Telangana, Chhattisgarh, and Odisha. Koyas call themselves Koitur in their dialect. The Koyas speak the Koya language, also known as Koya basha, which is a Dravidian language related to Gondi.[1]\r\n\r\nKoyas are commonly referred to as Koi, Koyalu, Koyollu, Koya Doralu, Dorala Sattam, etc. Koya tribes can be further divided into Koya, Doli Koya, Gutta Koya or Gotti Koya, Kammara Koya, Musara Koya, Oddi Koya, Pattidi Koya, Rasha Koya, Lingadhari Koya (ordinary), Kottu Koya, Bhine Koya, Raja Koya, etc.[2][3]\r\n\r\nPopulation & Livelihood\r\nThe Koya population is concentrated in northeastern Telangana, northern Andhra Pradesh, far-southern Chhattisgarh and southwestern Odisha.[4] In Telangana they live mainly in Khammam, Bhadradi Kothagudem and Warangal districts and are sparsely found in the old Adilabad and Karimnagar districts. In Andhra Pradesh the Koya mainly live in Alluri Sitharama Raju district, while in Odisha they live almost exclusively and are the dominant tribe in Malkangiri district in the far southwest of the state. in Chhattisgarh they live in the far-southern Bastar region, mainly in the districts of Sukma and Bijapur.[5] The Koya in Andhra Pradesh and Telangana had a population of 590,739 according to the 2011 census. However, many became residents of Andhra Pradesh when their lands became part of Andhra Pradesh during the Polavaram project. There are another 147,137 Koya in Odisha, and approximately 46,978 Dorla (who are a mixed group in-between Gondi and Koya) in Chhattisgarh.[6]\r\n\r\nAccording to Edgar Thurston, the Koya were formerly armed soldiers in the service of the various palegars in the region, and the time of his writing, practiced podu cultivation. Today the Koya are mainly settled cultivators and artisans, expertise in making bamboo furniture including mats for fencing, dust pans, and baskets. They grow Jowar, Ragi, Bajra and other millets. Tubers and roots such as Tella Chenna Gadda, Kirismatilu and edible green leaves such as Chencheli, Doggali, Gumuru, bacchalakura, gongura, pacchakura, pullakusiru, Thota kura, Boddukura are dietary staples as are curries made from some of these ingredients.[3]\r\n\r\n\r\nKoya village deity from Malkangiri district at the Odisha state tribal fair, Bhubaneshwar\r\nKoya practice marriage after maturity, and infant marriage is not practiced. The bride\'s maternal uncle has the deciding factor in the match, and cross-cousin marriages are permitted and common. Usually a wealthy groom will have no issues in finding a bride, but if they are poor enough, they can bribe the village headman to allow them to capture the bride. In the most simple Koya wedding ceremony, the bride bends her head and the groom leans over her, while water is poured on the husband\'s head by friends. Once the water has drained off the bride\'s head, they are said to be man and wife. They then drink milk, eat rice, and walk around a mound of earth organised under a pandal. They then get elders\' blessings and go to their new home.[7]\r\n\r\nDisplacement\r\nThe tribal community faces the new threats of development and conflicts, posing a serious questions on its existence and civilization. For instance, the displacement and migration of Gotti koyas tribals taking place in Andhra Pradesh. In the absence of land and access to a forest, the Koyas depend on wage labour in farm lands. The scarcity of these jobs lead to malnutrition of children and instances of anemia in women.[8] The Andhra Pradesh state government proposed Polavaram Project is posing a serious threat of displacement of 170,275 Koyas of the tribal population and more than 276 villages in the Khammam district of Bhadrachalam, Palwancha divisions.[9][10]', , 'About Koyas Tribe', '2023-12-18 19:59:39.000000', 7, 25);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(23, 'Abujmarh is a hilly forest area, spread over 4,000 square kilometres (1,500 sq mi) in Chhattisgarh, covering Narayanpur district, Bijapur district and Dantewada district. It is home to indigenous tribes of India, including Gond, Muria, Abuj Maria, and Halbaas. It was only in 2009 that the Government of Chhattisgarh lifted the restriction on the entry of common people in the area imposed in the early 1980s. Geographically isolated and largely inaccessible, the area continues to show no physical presence of the civil administration, and is also known as \"liberated-zone\" as it is an alleged hub of Naxalite-Maoist insurgency, the banned Communist Party of India (Maoist) and its military wing, People\'s Liberation Guerilla Army (PLGA), who run a parallel government in the area.[1][2]\r\n\r\nIn 2007 the area was proposed as a biosphere reserve by Ministry of Environment and Forests, Government of India.\r\n\r\nEtymology\r\nThe word abujmarh means \"the unknown hills\" (abuj means \'unknown\' and marh means \'hill\') in the Gondi language native to the region.[2][3]\r\n\r\nForest, about 92,000 square kilometres (36,000 sq mi) equivalent to the present Bastar division. Dandakaranya, literally meaning \"the abode of the demon Dandaka\", also finds mention in Hindu epic, Ramayana.[4]\r\n\r\nThe dense forests of Abujmarh have long been isolated from the outside world, inhabited largely the indigenous people, and accessible only via forest pathways starting from Narayanpur, Bijapur and Basroor. Geographically, the Indravati river segregates it from Bastar region, adding to its isolation.[5][6] Recently the access to area has been further marred by heavy use of landmines by the insurgents at entry points.[7] During the British rule in India, Abujmarh remained in isolation and constitutionally \"excluded\",[8] though a land survey was done in 1873.[9] After independence of India, its isolation continued, except when in 1958 the government refugees from East Bengal in the Dandakaranya area in the present Bastar division, and later the hills started getting exploited for its mineral wealth, like the Bailadila Hills excavated for its deposits of high-grade iron ore.[8] The tribals remained backward and exploited by prevalent feudalism in India,[8] majority of them started cultivation only recently, and education was undertaken only at small schools run either by NGOs and missionaries.[9] All these conditions, after 1967 gave rise to the Naxalite movement, which grew and spread over the coming decades.[8]\r\n\r\nAbujmarh has been termed as \"liberated zone\", as due to its inaccessibility it remained untouched by any government presence and civil administration for the past 60 years and has developed a stronghold of Naxal-Maoist insurgents of the banned Communist Party of India (Maoist), which ran a parallel government, known as Janta Sarkar (People\'s government). Besides running its own military wing, People’s Liberation Guerrilla Army (PLGA) and training camps, Moaoist also runs small irrigation projects, courts known as jan adalat (People’s courts) and schools.[2][10][11] The Times of India reported the existence of one such schools, known as \"Janta Sarkar Bhoomkaal School\" at Metapada, where besides elementary education, the students were also taught Naxal ideologies.[12] After being pushed out of Andhra Pradesh, post 2003, Naxals made these forests their hub, and even established a revenue generation system which includes land sharing, cooperative farming and running foodgrain and seeds banks.[11]', , 'About Abujmaria tribe', '2023-12-18 20:06:42.000000', 5, 19);
