known as the South Kanara Islands.', , 'About Aminidivis Tribe', '2023-12-18 21:41:19.000000', 7, 24);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(26, 'Malmis are a distinct human community of Lakshadweep. Connoting the term sign of ways, the people of Malmis group are predominantly sailors who, from a very long time, work under the Koyas of the island. Plying the local boats which are colloquially called as odams, the Malmis people are also quite deft in operating the nautical tables.\r\n\r\nAs one of the core communities of Lakshadweep, Malmis have an ancient heritage that coincides with the earliest civilizations of the place. During their gradual evolution, the Malmis of Lakshadweep were known to have served their superior counterparts - the Koyas.\r\n\r\nWith the passage of time although several changes have taken place in the island of Lakshadweep, the very occupational profile of Malmis has remained the same. Ferrying essential commodities like rice from one island to another, Malmis still ply the boats of the financially strong Koya people.\r\n\r\nThe population of Malmis community religiously follow the customs of Islamic faith. The culture of Malmis reflects the very respect of the people in the concerned religion. Apart from major local festivals, the Malmis have their own folk celebrations too where they perform various music and dance shows all of which represent the vibrant cultural tradition of Lakshadweep. From a socio-economic point of view, the people of Malmis community have enough prospects of growth.\r\n\r\nAlong with proper educational facilities, if the Malmis group can be provided with adequate occupational security, there is no doubt in the fact that in no time these people will emerge as one of the prosperous groups of Lakshadweep.', , 'About Malmis Tribe', '2023-12-18 21:43:50.000000', 7, 26);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(27, 'The Andamanese are the various indigenous peoples of the Andaman Islands, part of India\'s Andaman and Nicobar Islands, the union territory in the southeastern part of the Bay of Bengal. The Andamanese are a designated Scheduled Tribe in India\'s constitution.[7][8]\r\n\r\nThe Andamanese peoples are among the various groups considered Negrito, owing to their dark skin and diminutive stature. All Andamanese traditionally lived a hunter-gatherer lifestyle, and appear to have lived in substantial isolation for thousands of years.[9] It is suggested that the Andamanese settled in the Andaman Islands around the latest glacial maximum, around 26,000 years ago.[10][11]\r\n\r\nThe Andamanese peoples included the Great Andamanese and Jarawas of the Great Andaman archipelago, the Jangil of Rutland Island, the Onge of Little Andaman, and the Sentinelese of North Sentinel Island.[12] At the end of the 18th century, when they first came into sustained contact with outsiders, an estimated 7,000 Andamanese remained. In the next century, they experienced a massive population decline due to epidemics of outside diseases and loss of territory. Today, only roughly over 500 Andamanese remain, with the Jangil being extinct. Only the Jarawa and the Sentinelese maintain a steadfast independence, refusing most attempts at contact by outsiders.\r\n\r\nHistory\r\n\r\nGroup of Andamanese in c. 1903 or earlier.\r\nUntil the late 18th century, the Andamanese culture, language, and genetics were preserved from outside influences by their fierce reaction to visitors, which included killing any shipwrecked foreigners, and by the remoteness of the islands. The various tribes and their mutually unintelligible languages thus are believed to have evolved on their own over millennia.\r\n\r\nVenetian explorer Marco Polo wrote of the Andamanese in 1294, in The Travels of Marco Polo:[13]\r\n\r\nThe people are without a king and are Idolaters, and no better than wild beasts. And I assure you all the men of this Island of Angamanain have heads like dogs, and teeth and eyes likewise; in fact, in the face they are all just like big mastiff dogs! They have a quantity of spices; but they are a most cruel generation, and eat everybody that they can catch, if not of their own race. They live on flesh and rice and milk, and have fruits different from any of ours.\r\n\r\n', , 'About Andamanese Tribe', '2023-12-18 21:49:18.000000', 8, 27);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(28, 'The Sentinelese, also known as the Sentineli and the North Sentinel Islanders, are an indigenous people who inhabit North Sentinel Island in the Bay of Bengal in the northeastern Indian Ocean. Designated a particularly vulnerable tribal group and a Scheduled Tribe, they belong to the broader class of Andamanese peoples.\r\n\r\nAlong with the Great Andamanese, the Jarawas, the Onge, the Shompen, and the Nicobarese, the Sentinelese are one of the six native and often reclusive peoples of the Andaman and Nicobar Islands. Unlike the others, the Sentinelese appear to have consistently refused any interaction with the outside world. They are hostile to outsiders and have killed people who approached or landed on the island.[1]\r\n\r\nIn 1956, the Government of India declared North Sentinel Island a tribal reserve and prohibited travel within 3 nautical miles (5.6 kilometres) of it. It further maintains a constant armed patrol in the surrounding waters to prevent intrusions by outsiders. Photography is prohibited. There is significant uncertainty as to the group\'s size, with estimates ranging between 35 and 500 individuals, but mostly between 50 and 200.\r\n\r\nOverview:\r\nGeography:\r\nThe Sentinelese live on North Sentinel Island,[a] in the Andaman Islands, an Indian archipelago in the Bay of Bengal.[3][4] The island lies about 64 km (35 nmi) west of Andaman capital Port Blair.[5] It has an area of about 59.67 km2 (14,740 acres) and a roughly square outline.[6][5] The seashore is about 45 m (50 yd) wide, bordered by a littoral forest that gives way to a dense tropical evergreen forest.[5] The island is surrounded by coral reefs and has a tropical climate.[5]\r\n\r\nAppearance:\r\nComparative distributions of Andamanese indigenous peoples, early 1800s vs. 2004\r\nA 1977 report by Heinrich Harrer described a man as 1.60 metres (5 ft 3 in) tall, possibly because of insular dwarfism (the so-called \"Island Effect\"), nutrition, or simply genetic heritage.[7]\r\n\r\nPopulation:\r\nNo rigorous census has been conducted[5] and the population has been variously estimated to be as low as 15[dubious – discuss] or as high as 500. Most estimates lie between 50 and 200.[4][8][9][10]', , 'About Sentinelese Tribe', '2023-12-18 21:53:14.000000', 8, 28);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(29, 'The Shompen or Shom Pen are the indigenous people of the interior of Great Nicobar Island, part of the Indian union territory of Andaman and Nicobar Islands.\r\n\r\nThe Shompen are a designated as a Particularly Vulnerable Tribal Group[3] within the list of Scheduled Tribe.[4]\r\n\r\nEtymology and endonym\r\n\"Shompen\" is possibly an English mispronunciation of \"Shamhap\", the Nicobarese name for the tribe. The Shompens living on the western side of the island call themselves Kalay, and those on the eastern side Keyet, with both groups referring to each other as Buavela.[5] A suggestion from 1886 that the Shompen call themselves Shab Daw\'a has not been confirmed by modern research.[6]\r\n\r\nHistory of contact:\r\n\r\nA group of Shompen in 1886 with variation in hair types.[5]\r\nBefore the first outside contact with the Shompen in the 1840s, there is no reliable information about these peoples. Danish Admiral Steen Bille was the first to contact them in 1846 and Frederik Adolph de Roepstorff, a British officer who had already published works on the languages of Nicobar and Andaman,[7] collected ethnographic and linguistic data in 1876. Since then very little has been added to the stock of reliable information on the Shompen, mainly because access to the Nicobar Islands has been restricted for foreign researchers since Indian independence.[6] A polling station was set up in their area for election of 2014. Shompen people for the first time participated in the democratic process.[1][8]\r\n\r\nSociety\r\nIn 2001, the population was estimated at approximately 300.[5] Shompen Village-A and Shompen Village-B are home to most Shompens. Before the 2004 Indian Ocean earthquake and tsunami, the villages were home to 103 and 106 Shompens respectively.[9] However, by the time of 2011 census, only 10 and 44 people were left in these villages respectively.[10]\r\n\r\nThey practice a hunter-gatherer subsistence economy. In keeping with the tropical climate of the islands, traditional attire includes only clothing below the waist. The traditional attire for men is a short, thin loincloth made of bark cloth, covering only the genitals without a \'tail\' of cloth in front. Decoration is limited for men, consisting of bead necklaces and armbands. Women wear a knee-length skirt of bark cloth, occasionally with a shawl of bark cloth covering the shoulders. Decorations include bamboo ear plugs (ahav), bead necklaces (naigaak) and armbands of bamboo (geegap). Both sexes are barefoot. The Shompen probably learned to make and use bows from the Nicobaris. The main weapons are the bow and arrow. They do not use quivers but carry arrows by hand. Numerous types of spears, spear throwers, fire drills and a hatchet are the main tools.\r\n\r\nA man usually carried a bow and arrows, a spear and through his loincloth belt, a hatchet, knife and fire drill. The Shompen are a hunter-gatherer subsistence people, hunting wild game such as pigs, birds and small animals while foraging for fruits and forest foods. They also keep pigs and farm yams, roots, vegetables, and tobacco. Shompen huts are built to house 4 people, and villages are made up of 4 to 5 families. Once a child is grown enough, he makes his own hut. The lowland Shompen build their huts on stilts and the walls are made of woven material on a wood frame and the roof of thatched palm fronds, and the structure is raised on stilts. The highland Shompen build their houses on the ground, and the houses are made of the same materials as the raised houses. The interior is covered with mats, with sleeping mats on one end and tools and utensils hung on the walls and rafters. Cooking is done outside.\r\n\r\nIn the late 1980s, the Shompens were living in ten groups, ranging in size from 2 to 22 individuals, scattered across the interior of the island.[5]\r\n\r\nBecause of their isolated way of life in the interior of the island, the Shompens were largely protected from the 2004 Indian Ocean earthquake and tsunami that devastated the coastal regions inhabited by Nicobaris and the Indian population.', , 'About Shompen Tribe', '2023-12-18 21:55:44.000000', 8, 29);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(30, 'The Nicobarese people are an Austroasiatic-speaking people of the Nicobar Islands, a chain of islands in the Bay of Bengal north of Sumatra, forming part of the union territory of Andaman and Nicobar Islands, India. Only 12 of the 19 islands are inhabited. The largest and main island is Great Nicobar. The term Nicobarese refers to the dominant tribes of the Nicobar Islands. On each island, the people have specific names, but together they are the Nicobarese. They call themselves Holchu, which means \"friend\".[citation needed]\r\n\r\nThe Nicobarese are a designated Scheduled Tribe in India.\r\n\r\nA group of Nicobarese dancers\r\nHistory:\r\nThe Nicobarese may not have been the first people to live in the islands; they appear to have shared the islands with Shompen who came to the islands earlier. The islands have been under the power of various Asian empires in the 16th century, Denmark from 1754–1869, Great Britain from 1869–1947, and India from 1947. Today they are administered by India as part of the Union Territory of the Andaman and Nicobar Islands.\r\n\r\nLanguage:\r\nThe Nicobarese language is part of the Austroasiatic language family. All of the different islands speak different dialects of the Nicobarese language. The separate islands are categorized into four groups, although most of the people understand the Car Nicobar dialect.\r\n\r\nReligion :\r\nMost of the people of the islands are of the Christian religion, which was taught to them by a man named John Richardson who translated the New Testament into Nicobarese. Besides Christianity, other Nicobarese follow the traditional religion of the islands, which is animistic in nature. They believe in spirits, ghosts, and the existence of the soul. A person becomes a ghost after their death when their soul leaves their body and the ghosts of all the Nicobarese are all around the islands. They believe that the spirits are responsible for all of the unfortunate occurrences on the islands, in the event of which shamans are called upon to handle the bad spirits.', , 'About Nicobarese Tribe', '2023-12-18 21:58:12.000000', 8, 30);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(31, 'It is one of the most backward tribal groups in the states of Andhra Pradesh and Telangana.\r\nThey inhabit on both the banks of the Godavari River (East and West Godavari districts), in the hilly-forest region of Khammam (Telangana) and Srikakulam (Andhra Pradesh).\r\nThey live in the interior forest areas largely cut-off from the mainstream. Traditionally, they were shifting cultivators and recently, some of them have adopted settled agriculture and horticulture. \r\nCollection of non timber forest products and basket-making supplement the sources of their livelihood.\r\nTheir mother tongue is Telugu with a unique accent.\r\nKonda Reddis have also been recognized as Primitive Tribal Group (now Particularly Vulnerable Tribal Groups)\r\nThe Konda Reddis are known for their eco-friendly practices such as use of household articles made of bamboo, bottle gourd, and seed.\r\n\r\nReligion :\r\nMost of the people of Christian religion, which was taught to them by a man named John Richardson who translated the New Testament into Nicobarese. Besides Christianity, other Nicobarese follow the traditional religion of the islands, which is animistic in nature. They believe in spirits, ghosts, and the existence of the soul. A person becomes a ghost after their death when their soul leaves their body and the ghosts of all the Nicobarese are all around the islands. They believe that the spirits are responsible for all of the unfortunate occurrences on the islands, in the event of which shamans are called upon to handle the bad spirits.', , 'About Konda Reddies Tribe', '2023-12-18 22:03:19.000000', 9, 31),
(32, 'Khonds (also spelt Kondha and Kandha) are an indigenous Adivasi tribal community in India. Traditionally hunter-gatherers, they are divided into the hill-dwelling Khonds and plain-dwelling Khonds for census purposes, but the Khonds themselves identify by their specific clans. Khonds usually hold large tracts of fertile land, but still practice hunting, gathering, and slash-and-burn agriculture in the forests as a symbol of their connection to, and as an assertion of their ownership of the forests wherein they dwell. Khonds speak the Kui language and write it in the Odia script.\r\n\r\nThe Khonds are the largest tribal group in the state of Odisha. They are known for their rich cultural heritage, valourous martial traditions, and indigenous values, which center on harmony with nature. The Kandhamal district in Odisha has a fifty-five percent Khond population, and is named after the tribe.\r\n\r\nThey are a designated Scheduled Tribe in the states of Andhra Pradesh, Bihar, Chhattisgarh, Madhya Pradesh, Maharashtra, Odisha, Jharkhand and West Bengal.[3]\r\n\r\nLanguage :\r\nThe Khonds speak Kui and Kuvi as their native languages. They are most closely related to the Gondi language.[citation needed] Both are Dravidian languages and are written with the Odia script.[4]\r\n\r\nSociety:\r\nThe Khonds are adept land dwellers of the forest and hill environment. However, due to development interventions in education, medical facilities, irrigation, plantation, they have adapted to the modern way of life in many ways. Their traditional lifestyle, language, food habits, customary traits of economy, political organization, norms, values, and world view have been drastically changed in recent times.\r\n\r\nThe traditional Khond society is based on geographically demarcated clans, each consisting of a large group of related families identified by a Totem, usually of a male wild animal. Each clan usually has a common surname and is led by the eldest male member of the most powerful family of the clan. All the clans of the Khonds owe allegiance to the \"Kondh Pradhan\", who is usually the leader of the most powerful clan of the Khonds.\r\n\r\nThe Khond family is often nuclear, although extended joint families are also found. Female family members are on equal social footing with the male members in Khond society, and they can inherit, own, hold, and dispose of property without reference to their parents, husband or sons. Women have the right to choose their husbands, and to seek divorce. However, the family is patrilineal and patrilocal. Remarriage is common for divorced or widowed women and men. Children are never considered illegitimate in Khond society and inherit the clan name of their biological or adoptive fathers with all the rights accruing to natural born children.\r\n\r\n\r\nA traditional Khond house:\r\n\r\nKhond Girl\r\nThe Kondhs have a dormitory for adolescent girls and boys which forms a part of their enculturation and education process. The girls and boys sleep at night in their respective dormitory and learn social taboos, myths, legends, stories, riddles, proverbs amidst singing and dancing the whole night, thus learning the way of the tribe. The girls are usually instructed in good housekeeping and in ways to bring up good children while the boys learn the art of hunting and the legends of their brave and martial ancestors.\r\n\r\nBravery and skill in hunting determine the respect that a man gets in the Khond tribe. A large number of Khonds were recruited by the British during the First and Second World Wars and were prized as natural jungle warfare experts and fierce warriors. Even today a large proportion of the Khond men join the State police or Armed Forces of India to seek an opportunity to prove their bravery. Modern education has facilitated the entry of a large number of Khonds into Government Civil Service, and adaptation to modern life has ensured that the tribe is one of the most politically dominant in Odisha.\r\n\r\nThe men usually forage or hunt in the forests. They also practise the podu system of shifting cultivation on the hill slopes where they grow different varieties of rice, lentils and vegetables. Women usually do all the household work from fetching water from the distant streams, cooking, serving food to each member of the household to assisting the men in cultivation, harvesting and sale of produce in the market.[5]\r\n\r\nThe Khond commonly practice clan exogamy. By custom, marriage must cross clan boundaries (a form of incest taboo). The clan is strictly exogamous, which means marriages are made outside the clan (yet still within the greater Khond population). The form of acquiring mate is often by negotiation. However, marriage by capture or elopement is also rarely practiced. For marriage bride price is paid to the parents of the bride by the groom, which is a striking feature of the Khonds. The bride price was traditionally paid in tiger pelts though now land or gold sovereigns are the usual mode of payment of bride price.\r\n\r\nReligious beliefs:\r\n\r\nMeriah sacrifice post.\r\nTraditionally the Khond religious beliefs were syncretic combining totemism, animism, ancestor worship, shamanism and nature worship. British writers also note that the Khonds practiced human sacrifice.[6] Traditional Khond religion involved the worship mountains, Rivers, Sun, Earth. Baredi is place of worship. Traditional Khond religion involved different rituals such as Jhagadi or Kedu or Meriah Puja, Sru Penu Puja, Dharni Penu Puja, Guruba Penu Puja, Turki Penu Puja, and Pitabali Puja. Matiguru involved worship of earth through before sowing seeds. Other rituals connected with land fertility were \'Guruba Puja\', \'Turki Puja\' and in some cases \'Meriah Puja (human sacrifice)\' to appease Dharni (earth). Saru penu puja involved the sacrifice of fowls and feast. In Dehuri sacrifice goat and chicken were sacrificed. Gurba Penu Puja and Turki penu puja performed outside the village. Pitabali Puja was performed by offering flowers, fruits, sandal paste, incense, ghee-lamps, ghee, sundried rice, turmeric, buffalo or a he-goat and fowl.', , 'About Kondh Tribe', '2023-12-18 22:06:15.000000', 9, 32);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(33, 'Soliga, also spelled Solega, Sholaga and Shōlaga, is an ethnic group of India. Its members inhabit the mountain ranges mostly in the Chamarajanagar district of southern Karnataka and Erode district of Tamil Nadu. Many are concentrated in the Biligiriranga Hills and associated ranges, mainly in the talukas Yelandur, Kollegal and Chamarajanagar of Karnataka. The Soliga speak Sholaga, which belongs to the Dravidian family. Under Indian law, they are recognized as a scheduled tribe, they have a population of around 40,000.\r\n\r\nOrigin:\r\nThe Soliga tribe trace their origin to Karayya, son of Lord Maleya Mahadeshwara, swamy of Maleya Mahadeshwara Hills, Karnataka.[1] Legend says that on seeing Karayya\'s affinity towards wild animals, Lord Maleya Mahadeshwara swamy asked Karayya to reside in forests, whereas the other son Biliyayya resided in plains and became the forefather of Lingayats.[1]\r\n\r\nLanguage\r\nThe Soliga speak the Sholaga language (Soliganudi) as a mother tongue. A member of the Dravidian family, it is most closely related to Kannada with several Tamil influences.\r\n\r\nGroups\r\nThere are five sub groups of Soligas:\r\n\r\nMale Soliga: Kannada speakers residing in Karnataka\r\nUrali Soliga: Kannada and Tamil speakers, residing in border areas of Tamil Nadu\r\nPujari group: reside in Maleya Mahadeshwara Hills\r\nKadu Soliga: reside near Bandipur Forest\r\nBurude Soliga: reside in Heggadadevanakote Taluk and Kodagu\r\nFurthermore, these groups have several sub-groups.[1]\r\n\r\nOccupation and social status:\r\nThe Soliga used to practice shifting cultivation, but have more or less given up this practice now. They grow Ragi (Finger millet, Eleusine coracana) for subsistence. Their main source of income is harvesting and sale of Non-timber Forest Produce (NTFP) like honey, nellikai (gooseberry, Emblica officinalis), bamboo, Paasi (Lichen), algae, wild turmeric, Indian blackberry, soapnut and nennari (wild root). They also make baskets using bamboo.[1]\r\n\r\nThey are increasingly being brought to the \"mainstream\" with active Government and NGO initiative. Many have been given lands closer to \'civilised areas\' and most of the forest-dwelling population have been brought together into clusters called Podus. Most of the forest area they stay comes under wild life protection area. The Biligiriranga Hills is a Wildlife Sanctuary under Wildlife Protection Act, 1972, the Male Mahadeswara Hills is a Reserve Forest, and Bandipur is a National Park. Their rights on harvesting NTFP is being sought to be withdrawn citing conservation concerns, sparking a debate about the rights of indigenous people. The Soligas later won a court case to stay on their land.[3]\r\n\r\nReligion:\r\nSoliga people follow naturism and animism along with following Hindu practices and their main deities are Madeshwara, Rangaswamy of Biligirirangana Hills (who is considered the brother-in-law of the clan), Karayya, Kyate Devaru and Jadeswamy.[1]her deities worshipped by them include Madeshwara, Basaveshwara and Nanjundeshwara and Sri Alamelu Ranganayaki smetha Sri hanuma.', , 'About Soligas Tribe', '2023-12-18 22:08:47.000000', 9, 33);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(34, 'Paraja is a tribe found in the southern part of Orissa and some other parts of the Dandakaranya region. Their appearance is different from the other tribes (without the aborigines features) and have a distinct appearance and lifestyle. Their skin colour can vary from fair (cream) to ebony black. Hair strands are normally straight. Eyes are sunken deeper but not as hollow as other tribes. The average height of the Parajas is around 1.6 m. Parajas have a very rigid societal structure and do not eat at even Brahmin households. With time, this has become a forgotten practice and many tribal now do not even know about such rituals.\r\n\r\nThe nomenclature, ‘Paraja’, is a ‘local\r\nodia and desia term, which appears to have been\r\nderived from the Sanskrit word ‘Praja’ which\r\nliterally means the common people; who are\r\ncitizens under King or Raja. The term ‘Paraja’\r\nalso has another meaning in Odia denoting the\r\ntenant or the Royat.\r\nMajority of the Parajas are concentrated\r\nin the district of Koraput. Semiliguda, Pattangi,\r\nLamtaput, Laxmipur, Kundra, Boipariguda,\r\nJeypore Blocks of the Koraput district are native\r\nplaces of Parajas. In Koraput region the Parajas\r\nlive with Gadaba, Kondha, Rana and Domb.\r\nThere are four types of the Paraja in this region\r\ni.e. 1. Bada Paraja or Sodia Paraja; 2. Pengo\r\nParaja ; 3. Jodia Paraja and 4. Selia Paraja.\r\nGenerally, the first two groups comprise the Bada\r\nParaja and other two groups the Sana Paraja.', , 'About Parajas Tribe', '2023-12-18 22:12:52.000000', 9, 34);
INSERT INTO `blog` (`blog_id`, `description`, `image`, `name`, `upload_date_time`, `region_id`, `tribe_id`) VALUES
(35, 'Valmiki is a name used by a variety of communities throughout India who all claim descent from the author of the Ramayana, Valmiki. The Valmikis can be classified as a caste or Sampradaya (tradition/sect).[1] In the North West Punjab region, this caste had adopted Sikhism. During the Indian Rebellion of 1857, many valmiki were prominent freedom fighters. Notable examples include Matadin Bhangi, Gangu Mehtar, Bhura Singh Valmiki. At the present time many changes have been seen in this caste, now they incline towards politics[2] and government high positions.\r\n\r\nAccording to the 2001 Census of India, the Valmikis formed 11.2 per cent of the Scheduled Caste population in Punjab[3] and were the second-most populous Scheduled Caste in Delhi National Capital Region.[4][5][page needed] The 2011 Census of India for Uttar Pradesh showed the Valmiki population, which was classified as a Scheduled Caste, as 1,319,241.\r\n\r\nSouth India\r\nIn South India the term is mainly used as a self-identification by the Boya or Bedar caste, a traditional hunting and martial caste who are considered as Backward castes now changed by government of Andhra Pradesh into scheduled Tribes in Andhra Pradesh, Most Backward caste (MBC) in Tamil Nadu and Scheduled Tribe in Karnataka. The Valmikis are mainly concentrated in Anantapur, Kurnool and Kadapa districts of Andhra Pradesh and in Bellary, Raichur and Chitradurga districts of Karnataka, although they are spread all over the state.[7][8] They also built a temple of Valmiki in Anantapur, Andhra Pradesh.[9] In Andhra Pradesh they are known as Boya Valmikis or Valmikis.[10][11]\r\n\r\nOther countries\r\nIn the UK, the Council of Valmiki Sabhas UK claims to represent the Valmiki.\r\n\r\nSee also\r\nMazhabi Sikh\r\nMatadin Bhangi\r\nMadakari Nayaka\r\nBhai Jiwan Singh\r\nBhura Singh Valmiki\r\nGangu Baba\r\nSikh Light Infantry\r\nValmiki\r\nBhagwan Valmiki Tirath Sthal\r\nBalmikism\r\nValmiki Ashram\r\n', , 'About Valmikis Tribe', '2023-12-18 22:15:11.000000', 9, 35);

