INSERT INTO `region` (`region_id`, `description`, `name`) VALUES
(1, 'The Northeastern Himalayas, in the northeastern part of India, are characterized by dense forests, high mountains, and numerous rivers. This region is rich in biodiversity, home to various indigenous communities, and features a diverse range of flora and fauna.\n', 'Northeastern Himalayas'),
(2, 'Also known as the Deccan Plateau, the Central Plateau in southern India is marked by rolling plains, hills, and mountain ranges. Major rivers like the Godavari and Krishna flow through this vast elevated region, which has played a significant role in the historical and cultural development of the country.', 'Deccan Plateau'),
(3, 'Part of the larger Himalayan mountain range, the Western Himalayas cover states like Jammu and Kashmir, Himachal Pradesh, and Uttarakhand. With breathtaking landscapes, high mountain peaks, and cultural diversity, this region is a significant geographical and cultural feature of India.', 'Western Himalayas'),
(4, 'Situated in the southern part of India, spanning Tamil Nadu, Karnataka, and Kerala, the Nilgiri Hills are known for their tea and coffee plantations. The region boasts unique biodiversity, and the Nilgiri Tahr, an endangered mountain goat, is among its notable inhabitants.', 'Nilgiri Hills'),
(5, 'The Gangetic Plain, formed by the Ganges River and its tributaries, is a vast and fertile plain. Among the most densely populated regions globally, it serves as a crucial agricultural area supporting the livelihoods of millions of people.', 'Gangetic Plain'),
(6, 'In the northwestern part of India, primarily in Rajasthan, the Thar Desert is characterized by arid landscapes and sand dunes. The region features a unique desert ecosystem and is known for its vibrant cultural heritage.', 'Thar Desert'),
(7, 'A group of islands in the Arabian Sea off the southwestern coast of India, Lakshadweep is known for its coral atolls, clear blue waters, and diverse marine life. The islands are important for tourism and fishing activities.', 'Lakshadweep Islands'),
(8, 'Located in the Bay of Bengal, the Andaman and Nicobar Islands are a union territory of India. Known for tropical rainforests, coral reefs, and indigenous tribes, the islands are rich in biodiversity and offer a unique blend of natural beauty and cultural heritage.', 'Andaman and Nicobar Islands'),
(9, 'Stretching along the eastern coast of India and spanning states like Odisha, Andhra Pradesh, Tamil Nadu, and Karnataka, the Eastern Ghats feature diverse landscapes with forests, valleys, and waterfalls. The region supports varied ecosystems and contributes to the overall geographical diversity of India.', 'Eastern Ghats');

