(3, 'The Lushai, also known as the Mizo people, inhabit the state of Mizoram. They have a vibrant culture, which includes traditional dance forms, festivals, and handwoven textiles.', 'Lushai', 1),
(4, 'The Meitei people are the majority ethnic group in Manipur. They have a rich history and cultural heritage, including the classical dance form known as Manipuri dance.', 'Meitei', 1),
(5, 'The Konyak Naga people are well-known for their distinct tattoos, traditional headhunting practices (historically), and vibrant festivals. They reside in Nagaland, contributing to the state\'s cultural diversity.', 'Konyak', 1),
(6, 'The Chakma people are a prominent ethnic group in Tripura. They have their own language and cultural practices, with a significant presence in the Chittagong Hill Tracts region as well.', 'Chakma', 1),
(7, 'The Gonds are one of the largest tribal groups in central India. They have a rich cultural heritage, known for their traditional art, music, and dance forms.', 'Gonds', 2),
(8, 'The Bhil people are spread across central and western India. They are known for their unique art forms, including Pithora painting, and have a traditional lifestyle closely connected to nature.', 'Bhil', 2),
(9, 'The Kols are an indigenous people residing in central India. They have their own folklore, rituals, and cultural practices, contributing to the diverse cultural landscape of the region.', 'Kol', 2),
(10, 'The Santhal tribe is mainly found in the states of Jharkhand, West Bengal, and Odisha. They have a distinct cultural identity, with traditional music and dance being integral to their way of life.', 'Santhal', 2),
(11, 'The Korku people inhabit parts of Madhya Pradesh and Maharashtra. They have a unique cultural heritage, with traditional practices, rituals, and folklore that reflect their close connection to nature.', 'Korku', 2),
(12, 'The Gaddi people are predominantly found in the Himachal Pradesh region of the Western Himalayas. They are known for their pastoral lifestyle, colorful attire, and traditional festivals.', 'Gaddi', 3),
