(14, 'The Swangala people are a community in the Western Himalayas, known for their unique customs, rituals, and folk traditions. They contribute to the cultural mosaic of the region.', 'Swangala', 3),
(15, 'The Jad people, also known as Jad Bhotias, inhabit the border areas of Uttarakhand. They are engaged in trade and agriculture, and their culture reflects the influences of the Himalayan region.', 'Jad', 3),
(16, 'The Badaga people are a Dravidian ethnic group in the Nilgiri Hills of Tamil Nadu. They are known for their distinct language, customs, and agricultural practices.', 'Badaga', 4),
(17, 'The Irula people reside in the Nilgiri Hills and are known for their expertise in snake-catching and traditional medicinal knowledge. They have a unique cultural identity.', 'Irula', 4),
(18, 'The Kota people are indigenous to the Nilgiri Hills. They have a distinctive culture with traditional dances, rituals, and an agricultural way of life.', 'Kota', 4),
(19, 'The Abujhmaria are an indigenous tribal group in the central part of the Gangetic Plain. They have a unique cultural identity and are known for their traditional practices and rituals.', 'Abujhmaria', 5),
(20, ' The Baiga people, residing in parts of Madhya Pradesh and Chhattisgarh, are known for their traditional art, especially tattooing. They have a close connection to the forests and nature.', 'Baiga', 5),
(21, 'The Bharia people are indigenous to the Gangetic Plain and are known for their traditional agriculture, art, and cultural practices.', 'Bharia', 5),
(22, 'The Nayaka people, also known as Nayakar, are found in the Thar Desert region. They traditionally engage in agriculture and have a unique cultural heritage.', 'Nayaka', 6),
(23, 'The Banjara community, spread across the Thar Desert and beyond, is traditionally associated with nomadic pastoralism and trade. They have a distinct culture and are known for their colorful attire.', 'Banjaras', 6),
(24, 'The Aminidivi people are native to the Lakshadweep Islands. They have their own cultural traditions and are involved in activities such as fishing and coir production.', 'Aminidivis', 7),
(25, 'The Koyas, also present in the Lakshadweep Islands, are known for their traditional practices and cultural heritage, which reflects the island\'s unique identity.', 'Koyas', 7),
(26, 'The Malmis people contribute to the cultural diversity of the Lakshadweep Islands, with traditional practices related to fishing and island life.', 'Malmis', 7),
(27, 'The Andamanese people are among the indigenous communities of the Andaman Islands. They have a unique culture and were historically hunter-gatherers.', 'Andamanese', 8),
(28, 'The Sentinalese are one of the few remaining uncontacted peoples in the world, residing on North Sentinel Island. They are known for their isolation from the outside world.', 'Sentinelese', 8),
(29, 'The Shompens are an indigenous group in the Nicobar Islands with their own distinct culture and traditions.', 'Shompens', 8),
(30, 'The Nicobarese people, native to the Nicobar Islands, have a rich cultural heritage, including traditional dances, music, and unique rituals.', 'Nicobarese', 8),
(31, 'Indigenous to the Eastern Ghats, the Konda Reddies are known for their traditional agricultural practices and rich cultural heritage, deeply rooted in the hilly terrain.', 'Konda Reddies', 9),
(32, 'The Kondh people, a major tribal community in the Eastern Ghats, celebrate their vibrant culture through distinctive dance forms and music, reflecting their close connection to nature and agriculture. They have a diverse cultural identity tied to the cycles of nature.', 'Kondh', 9),
(33, 'Residing in the forests of the Eastern Ghats, the Soligas have a unique way of life closely connected to nature, with traditional knowledge of herbal medicine and sustainable forest practices. They express their cultural identity through traditional songs and dances.', 'Soligas', 9),
(34, 'Contributing to the cultural diversity of the Eastern Ghats, the Paraja people have customs, traditions, and rituals deeply rooted in their agrarian lifestyle. They engage in vibrant dance and music during festivals, showcasing their rich cultural heritage.', 'Parajas', 9),
